ion type.'=>'Un identificador único para cada transacción en función de su tipo de transacción.','A unique identifier for the deposit.'=>'Un identificador único para el depósito.','A unique source id for each transaction.'=>'Un identificador de origen único para cada transacción.','A valid shipping address is required for Afterpay payments.'=>'Se requiere una dirección de envío válida para los pagos Afterpay.','A valid signature is missing on the document. Upload a document that includes a valid signature.'=>'En el documento falta una firma válida. Sube un documento que contenga una firma válida.','A voucher based payment method for your customers in Portugal.'=>'Un método de pago basado en cupones para tus clientes de Portugal.','A {{strong}}charge{{/strong}} is the amount billed to your customer’s payment method.'=>'Un {{strong}}cargo{{/strong}} es la cantidad facturada al método de pago de tu cliente.','ACH Credit Transfer'=>'Transferencia de crédito ACH','ACH Debit'=>'Débito ACH','ACSS Debit'=>'Débito ACSS','AID'=>'SOPORTE','AMOUNT PAID'=>'CANTIDAD PAGADA','API error message to throw as ExceptionError: %1$s'=>'Error: %1$s','AVS Mismatch'=>'Discrepancias del AVS','Accept'=>'Aceptar','Accept dispute'=>'Aceptar la disputa','Accept payments in multiple currencies. Prices are converted based on exchange rates and rounding rules. <a href="%s">Learn more</a>'=>'Aceptar pagos en distintas monedas. La conversión de los precios se hace en función de los tipos de cambio de divisas y de las reglas de redondeo. <a href="%s">Obtén más información</a>','Accept payments in multiple currencies. Prices are converted based on exchange rates and rounding rules. <learnMoreLink>Learn more</learnMoreLink>'=>'Aceptar pagos en distintas monedas. Los precios se convierten en función de los tipos de cambio de divisas y de las reglas de redondeo. <learnMoreLink>Más información</learnMoreLink>','Accept payments via credit card. Manage transactions within WordPress.'=>'Acepta pagos con tarjeta de crédito. Gestiona las transacciones en WordPress.','Accept payments with Przelewy24 (P24), the most popular payment method in Poland.'=>'Aceptamos pagos con Przelewy24 (P24), el método de pago más popular de Polonia.','Accept secure bank transfers from Austria, Belgium, Germany, Italy, Netherlands, and Spain.'=>'Acepta transferencias bancarias seguras de Alemania, Austria, Bélgica, España, Italia y Países Bajos.','Accept the dispute tooltip'=>'Sugerencia de aceptación de disputa','Accept the dispute?'=>'¿Quieres aceptar la disputa?','Accept your payment with EPS — a common payment method in Austria.'=>'Acepta el pago con EPS, un método de pago habitual en Austria.','Accepting the dispute marks it as <em>Lost</em>. The disputed amount and the %s dispute fee will not be returned to you.'=>'Aceptar la disputa la marca como <em>Perdida</em>. No se le devolverá el importe impugnado ni la tasa de impugnación %s.','Accepting…'=>'Aceptando...','Account'=>'Cuenta','Account ID'=>'ID de cuenta','Account Tools'=>'Herramientas de la cuenta','Account Type'=>'Tipo de Cuenta','Account details'=>'Detalles de la cuenta','Acquirer Reference Number (ARN) %s'=>'Número de referencia del adquiriente (ARN) %s','Action'=>'Acción','Action failed. Please refresh the page and retry.'=>'La acción falló. Por favor, refresque la página e intente nuevamente.','Activate WooCommerce'=>'Activar WooCommerce','Activate payments'=>'Activar pagos','Activate payments on your store'=>'Activar pagos en tu tienda','Active'=>'Activo','Active discounts'=>'Descuentos activos','Active loan overview'=>'Resumen del préstamo','Add %s currency'=>'Añadir %s moneda' . "\0" . 'Añadir %s monedas','Add a currency switcher to the Storefront theme on breadcrumb section.'=>'Añade un conversor dinámico de monedas al tema de Storefront en la sección de breadcrumb. ','Add additional payment methods'=>'Añade métodos de pago adicionales','Add and edit payments available to customers at checkout. Based on their device type