ción con el cliente que consideres pertinente para el caso (p. ej., correos electrónicos que demuestren que el cliente recibió o usó el producto o servicio).','Any receipt or message sent to the customer notifying them of the charge. This field will be automatically filled with a Stripe generated email receipt if any such receipt was sent.'=>'Cualquier recibo o mensaje enviado al cliente por el que se le notifique el cargo. Este campo se rellenará automáticamente con un recibo por correo electrónico generado por Stripe en caso de que el recibo se haya enviado.','Any server or activity logs showing proof that the cardholder accessed or downloaded the purchased digital product. This information should include IP addresses, corresponding timestamps, and any detailed recorded activity.'=>'Cualquier registro de servidor u actividad que demuestre que el titular de la tarjeta accedió al producto digital comprado o lo descargó. Esta información debe incluir direcciones IP, las marcas de hora correspondientes y cualquier actividad registrada detallada.','Apple Pay'=>'Apple Pay','Apple Pay / Google Pay'=>'Apple Pay/Google Pay','Apple Pay / Google Pay Express Checkout'=>'Pago rápido de Apple Pay/Google Pay','Apple Pay / Google Pay buttons'=>'Botones de Apple Pay/Google Pay','Apple Pay domain verification failed with the following error:'=>'La verificación del dominio de Apple Pay ha producido el siguiente error:','Apple Pay domain verification failed.'=>'Error al verificar el dominio de Apple Pay.','Apple Pay is an easy and secure way for customers to pay on your store.'=>'Apple Pay ofrece a los clientes una forma sencilla y segura de pagar en tu tienda. ','Apple Pay is an easy and secure way for customers to pay on your store. By enabling this feature, you agree to {{stripeLink}}Stripe{{/stripeLink}} and{{appleLink}} Apple{{/appleLink}}\'s terms of use.'=>'Apple Pay ofrece a los clientes una forma sencilla y segura de pagar en tu tienda. Al activar esta función, aceptas los términos de uso de {{stripeLink}}Stripe{{/stripeLink}} y {{appleLink}}Apple{{/appleLink}}.','Application Name'=>'Nombre de aplicación','Application name'=>'Nombre de aplicación','Approve Transaction'=>'Aprobar transacción','Approved'=>'Aprobado','Approving this transaction will capture the charge.'=>'Si se aprueba esta transacción, se cobrará el cargo.','Are these metrics helpful?'=>'¿Te resultan útiles estas métricas?','Are you satisfied with WooPayments?'=>'¿WooPayments cumple tus expectativas?','Are you sure you want to continue?'=>'¿Seguro que quieres continuar?','Are you sure you want to deactivate %s?'=>'¿Estás seguro de que quieres desactivar %s?','Are you sure you want to enable test mode?'=>'¿Seguro que quieres activar el modo de prueba?','Are you sure you want to remove {{strong}}%s (%s){{/strong}}? Your customers will no longer be able to pay in this currency and use payment methods listed below.'=>'¿Seguro que quieres eliminar {{strong}}%s (%s){{/strong}}? Tus clientes ya no podrán pagar en esta moneda ni utilizar los métodos de pago que se indican a continuación.','Are you sure you want to remove {{strong}}%s{{/strong}}? Your customers will no longer be able to pay using %s.'=>'¿Seguro que quieres eliminar {{strong}}%s{{/strong}}? Tu clientes no podrán pagar mediante %s.','Are you sure you\'re ready to submit this evidence? Evidence submissions are final.'=>'¿Seguro que estás listo para enviar las pruebas? Los envíos de pruebas son definitivos.','Are you sure?'=>'¿Estás seguro?','Are you trying to issue a refund for this order? If so, please click {{doNothingBold/}} and see our documentation on {{howtoIssueRefunds/}}. If you want to mark this order as Cancelled without issuing a refund, click {{cancelOrderBold/}}.'=>'¿Estás intentando emitir un reembolso de este pedido? Si es así, haz clic en {{doNothingBold/}} y consulta nuestra documentación sobre {{howtoIssueRefunds/}}. Si quieres marcar este pedido como Cancelado sin emitir ningún reembolso, haz clic