payment was not approved by the card holder.'=>'El titular de la tarjeta no ha aprobado pagos recurrentes superiores al importe del mandato o a 15.000 INR.','For security, this filter is enabled and cannot be modified. Payments failing CVC verification will be blocked. {{learnMoreLink}}Learn more{{/learnMoreLink}}'=>'Por motivos de seguridad, este filtro está activado y no se puede modificar. Los pagos que no superen la verificación del CVC se bloquearán. {{learnMoreLink}}Más información{{/learnMoreLink}}','Formatting rules'=>'Normas de formato','France'=>'Francia','Fraud &amp; Risk'=>'Fraude y riesgos','Fraud Protection Level'=>'Nivel de protección contra el fraude','Fraud protection'=>'Protección contra el fraude','Fraud risk level.'=>'Nivel de riesgo de fraude.','Fraudulent'=>'Fraudulento','Fraudulent transactions often use fake addresses to place orders. If the IP address seems to be in one country, but the billing address is in another, that could signal potential fraud.'=>'Las transacciones fraudulentas suelen utilizar direcciones falsas para realizar los pedidos. Si la dirección IP parece estar en un país, pero la dirección de facturación está en otro, eso podría indicar un posible fraude.','Frequency'=>'Frecuencia','Friday'=>'viernes','From %1$f%% + %2$s'=>'Desde %1$f%% + %2$s','Funds are available for payout %s business days after they’re received.'=>'Los fondos están disponibles para su pago %s días hábiles después de haberlos recibido.','Future payout'=>'Pago futuro','General'=>'General','General evidence'=>'Pruebas generales','Germany'=>'Alemania','Get %1$s via instant payout. Funds are typically in your bank account within 30 mins. Fee: %2$s%%.'=>'Consigue %1$s mediante pago instantáneo. Los fondos suelen estar en tu cuenta bancaria en 30 minutos. Tasa: %2$s%%.','Get %s now'=>'Obtener %s ahora','Get immediate access to your funds when you need them – including nights, weekends, and holidays. With %s\' <a>Instant Payouts feature</a>, you\'re able to transfer your earnings to a debit card within minutes.'=>'Obtén acceso inmediato a tus fondos en cualquier momento, incluso por la noche, en fines de semana y festivos. Con la <a>función Pagos instantáneos</a> de %s, podrás transferir tus ingresos a una tarjeta de débito en cuestión de minutos.','Get started'=>'Primeros pasos','Get your customer to withdraw the dispute by helping them identify the payment. Otherwise, challenge the dispute with appropriate evidence that proves the purchase was legitimate. '=>'Consigue que el cliente retire la disputa ayudándole a identificar el pago. Si no, refútala con las pruebas pertinentes que demuestren que la compra fue legítima. ','Go to Multi-Currency settings'=>'Ir a la configuración de multidivisa','Go to payments settings'=>'Ir a la configuración de pago','Good afternoon'=>'Buenas tardes','Good afternoon, %s'=>'Buenas tardes, %s','Good evening'=>'Buenas noches','Good evening, %s'=>'Buenas noches, %s','Good morning'=>'Buenos días','Good morning, %s'=>'Buenos días, %s','Good news! You won this dispute on %s. The disputed amount and the dispute fee have been credited back to your account. <a>Learn more about preventing disputes</a>.'=>'¡Buenas noticias! Ganaste esta disputa el %s. El importe impugnado y la tarifa de la disputa se han abonado de nuevo en tu cuenta. <a>Más información sobre la prevención de disputas</a>.','Google Pay'=>'Google Pay','Google Pay is incompatible with test mode. {{learnMore}}Learn more{{/learnMore}}.'=>'Google Pay no es compatible con el modo de pruebas. {{learnMore}}Más información{{/learnMore}}.','Got it'=>'Entendido','GrabPay'=>'GrabPay','Great news — your %s account has been activated. You can now start accepting payments on your store, subject to {{restrictionsLink}}certain restrictions{{/restrictionsLink}}.'=>'Buenas noticias: se ha activado tu cuenta de %s. Ya puedes empezar a aceptar pagos en tu tienda (sujeto a {{restrictionsLink}}determinadas restricciones{{/restrictionsLink}}).','Great news — your %s account has been activated. You can now start accepting payments on your store.'=>'Buenas noticias: se ha activado tu cuenta de %s. Ya puedes empezar a aceptar pagos en tu tienda.','Greece'=>'Grecia','Green check mark'=>'Marca de verificación verde','Held for review'=>'Retenido para su revisión','Help avoid unauthorized transactions and disputes by setting your fraud protection level.'=>'Ayuda a evitar transacciones no autorizadas y disputas estableciendo tu nivel de protección contra el fraude.','Help other businesses succeed'=>'Ayuda a otros negocios a triunfar','Help us make improvements to %s'=>'Ayúdanos a mejorar %s','Here\'s a brief list of the information you\'ll need to finish payment signup:'=>'A continuación, te mostramos una breve lista de la información que necesitarás para finalizar la inscripción en Payments:','Hi %s,'=>'Hola, %s,','Hi%s, Welcome to %s!'=>'Hola, %s: Te damos la bienvenida a %s.','Hide tasks'=>'Ocultar tareas','High'=>'Alta','Highest'=>'Más alto','Home address'=>'Dirección particular','Hong Kong'=>'Hong Kong','How does this filter protect me?'=>'¿Cómo me protege este filtro?','How quickly will you confirm my identity and allow me to process payments?'=>'¿Cuánto tardaréis en confirmar mi identidad y permitirme procesar los pagos?','Http request failed. Reason: %1$s'=>'Error en la solicitud HTTP. Motivo: %1$s','Hungary'=>'Hungría','I\'m registered for a %1$s'=>'Estoy registrado para obtener un %1$s','I\'m setting up a store for someone else.'=>'Estoy configurando una tienda para otra persona.','IBAN'=>'IBAN','ID'=>'ID ','ID for the payment intent.'=>'ID de la intención de pago.','ID for the payment method.'=>'ID del método de pago.','IP Address Mismatch'=>'Dirección IP incorrecta','Icelandic Króna does not accept decimals. Please update your currency number of decimals to 0 or select a different currency. %1$sVisit settings%2$s'=>'La corona islandesa no admite números decimales. Establece el número de decimales en 0 o elige otra divisa. %1$sVer Ajustes%2$s','If %s "Saved cards" should be enabled.'=>'En el caso de que se deban activar las "tarjetas guardadas" de %s.','If %s express checkouts should be enabled.'=>'En el caso de que se deba activar el pago exprés de %s.','If %s manual capture of charges should be enabled.'=>'En el caso de que se deba activar la captura manual de los cargos de %s.','If %s should be enabled.'=>'En el caso de que se deba activar %s.','If Stripe Billing is enabled.'=>'Si Stripe Billing está activado.','If WooPay should be enabled.'=>'Si WooPay debe habilitarse.','If enabled, users will be able to pay using Apple Pay, Google Pay or the Payment Request API if supported by the browser.'=>'Si la opción está activada, los usuarios podrán pagar mediante Apple Pay, Google Play o la API de Payment Request (si lo admite el navegador).','If enabled, users will be able to pay with a saved card during checkout. Card details are saved on our platform, not on your store.'=>'Si la opción está activada, los usuarios podrán pagar con una tarjeta guardada durante el pago. Los datos de la tarjeta se guardan en nuestra plataforma, no en tu tienda.','If the cardholder agrees to withdraw the dispute, you should still submit evidence for the dispute using the forms on the next screen. In addition to the following evidence, your submission should include correspondence with the cardholder saying they would withdraw the dispute and a written statement from their card issuer confirming that the dispute has been withdrawn.'=>'Si el titular de la tarjeta acepta retirar la disputa, debes presentar igualmente las pruebas de esta mediante los formularios de la siguiente pantalla. Además de las pruebas siguientes, en el envío debes incluir la correspondencia con el cliente en la que se indique que se retira de la disputa y una declaración escrita del emisor de la tarjeta de crédito que confirme que la disputa se ha retirado.','If the customer has not yet returned the product or canceled the service, provide specific information to that effect. You should double-check your incoming shipping records to verify that you have not received a return before you respond. If you have processed a credit or reversal for this transaction, provide evidence of this which includes the amount and date processed.'=>'Si el cliente aún no ha devuelto el producto o cancelado el servicio, facilita información específica al respecto. Antes de responder, debes volver a comprobar los registros de envíos entrantes para verificar que no has recibido ninguna devolución. Si has procesado un abono o una anulación de la transacción, proporciona pruebas que incluyan el importe y los datos procesados.','If the customer withdraws their dispute you should still submit evidence using the forms on the next screen. Be sure to provide a letter or email from the cardholder stating that they are no longer in dispute.'=>'Si el cliente retira la disputa, debes enviar igualmente las pruebas pertinentes mediante los formularios de la pantalla siguiente. Asegúrate de proporcionar una carta o un correo electrónico del titular de la tarjeta en los que se indique que retira la disputa.','If the product or service is as described, provide specific information (invoice, contract, etc.) to refute the cardholder’s claims. Quality disputes are where the customer does not agree with the condition of merchandise or service received (e.g., a car repair situation or quality of a hotel room). There may be instances where you will need to obtain a neutral third-party opinion to help corroborate your claim against the cardholder. Provide as much specific information and documentation as possible to refute the cardholder’s claims. It is recommended that you address each point that the cardholder has made.'=>'Si el producto o el servicio son conformes a lo descrito, proporciona información específica (factura, contrato, etc.) para refutar la reclamación del titular de la tarjeta. Las disputas por motivos de calidad se producen cuando el cliente no acepta el estado de la mercancía o del servicio recibido (p. ej., el estado de la reparación de un coche o la calidad de una habitación de hotel). En algunos casos, puede que necesites la opinión de un tercero neutral para que te ayude a corroborar tu reclamación contra el titular de la tarjeta. Proporciona toda la información específica y documentación posible para refutar la reclamación del titular de la tarjeta. Se recomienda que abordes cada punto que haya planteado el titular de la tarjeta.','If there have been two or more separate payments, you should get in touch with your customer. If you understand what their complaint is, there is a chance for you to explain the misunderstanding or to make it right. If you’re able to resolve the issue with your customer, you can ask that they withdraw the dispute.'=>'Si se han hecho dos o más pagos por separado, debes ponerte en contacto con tu cliente. Si entiendes su queja, tienes la oportunidad de explicarle el malentendido o arreglarlo. Si consigues resolver el problema con el cliente, puedes pedirle que retire la disputa.','If there were duplicate payments, you should accept the dispute. You cannot issue a refund while a payment is being disputed. The credit card networks place liability for accepting disputed payments with you, the business.'=>'Si ha habido pagos duplicados, debes aceptar la disputa. Puedes emitir un reembolso mientras el pago es objeto de disputa. Las redes de tarjetas de crédito asumen la responsabilidad de aceptar los pagos objeto de disputa ante ti, es decir, el negocio.','If they were not, collect any and all information documenting that each payment was made separately, such as copies of receipts. If the receipts don’t include the items purchased, be sure to include an itemized list. Each receipt should clearly indicate that the payments are for separate purchases of items or services. If you’ve been able to get in touch with the customer you should be sure to address any concerns they had in your evidence.'=>'Si no lo hace, recopila toda la información que demuestre que cada pago se hizo por separado, p. ej., copias de los recibos. Si en los recibos no constan los artículos comprados, asegúrate de incluir una lista detallada. En cada recibo se debe indicar claramente que los pagos corresponden a compras por separado de artículos o servicios. Si no has conseguido ponerte en contacto con el cliente, debes asegurarte de atender su problema con tus pruebas.','If you believe the dispute is invalid, you can challenge it by submitting the appropriate evidence using the response forms on the next screen.'=>'Si crees que la disputa no es válida, puedes refutarla enviando las pruebas pertinentes mediante los formularios de respuesta de la página siguiente.','If you believe the payment was actually made using a stolen credit card, you will need to accept the dispute. The credit card networks place liability for accepting unauthorized transactions with you, the business.'=>'Si crees que en realidad el pago se hizo con una tarjeta de crédito robada, debes aceptar la disputa. Las redes de tarjetas de crédito asumen la responsabilidad de aceptar las transacciones no autorizadas ante ti, es decir, el negocio.','If you can not prove the customer received their product or service as described, you should accept the dispute. You cannot issue a refund while a payment is being disputed. The credit card networks place liability for accepting disputed payments with you, the business.'=>'Si no puedes demostrar que el cliente recibió el producto o servicio conforme a lo descrito, debes aceptar la disputa. Puedes emitir un reembolso mientras el pago es objeto de disputa. Las redes de tarjetas de crédito asumen la responsabilidad de aceptar los pagos objeto de disputa ante ti, es decir, el negocio.','If you can not prove the customer received their product or service, you should accept the dispute. You cannot issue a refund while a payment is being disputed. The credit card networks place liability for accepting disputed payments with you, the business.'=>'Si no puedes demostrar que el cliente recibió el producto o servicio, debes aceptar la disputa. Puedes emitir un reembolso mientras el pago es objeto de disputa. Las redes de tarjetas de crédito asumen la responsabilidad de aceptar los pagos objeto de disputa ante ti, es decir, el negocio.','If you can not prove the customer’s subscription was canceled, and or they did not follow your cancellation policy, you should accept the dispute. You cannot issue a refund while a payment is being disputed. The credit card networks place liability for accepting disputed payments with you, the business.'=>'Si no puedes demostrar que la suscripción del cliente estaba cancelada o que este no siguió tu política de cancelación, debes aceptar la disputa. Puedes emitir un reembolso mientras el pago es objeto de disputa. Las redes de tarjetas de crédito asumen la responsabilidad de aceptar los pagos objeto de disputa ante ti, es decir, el negocio.','If you choose to continue, our payment partner Stripe will send an e-mail to {{merchantEmail /}} to collect the required information'=>'Si decides continuar, Stripe, nuestro socio de pagos, te enviará un correo electrónico a {{merchantEmail /}} para recopilar la información necesaria.','If you do not want these subscriptions to continue to be billed, you should %1$scancel all subscriptions%2$s prior to deactivating %3$s. '=>'Para que no te sigan facturando estas suscripciones, debes %1$scancelar todas las suscripciones%2$s antes de desactivar %3$s. ','If you do not want these subscriptions to continue to be billed, you should %1$scancel these subscriptions%2$s prior to deactivating %3$s.'=>'Para que no te sigan facturando estas suscripciones, debes %1$scancelar todas estas suscripciones%2$s antes de desactivar %3$s.','If you\'re setting up %s for someone else, it\'s best to have that person complete the account creation process. As you can see above, we ask for very specific information about the business owner - and you might not have all the details at hand. It\'s not always possible to change account information once it\'s been saved, especially if the site accepts live transactions before the correct account information is entered.'=>'Si estás configurando %s para otra persona, lo mejor es que sea ella quien complete el proceso de creación de la cuenta. Como puedes ver arriba, pedimos información muy concreta sobre el propietario del negocio (y puede que no tengas todos los datos a tu alcance). No siempre es posible modificar la información de la cuenta una vez que se ha guardado, sobre todo si el sitio web acepta transacciones antes de que se haya introducido la información correcta de la cuenta.','If your customer made no attempt to return the product or cancel the service, or if you provided a replacement product or service, make sure to note that as well.'=>'También debes indicar si el cliente no intentó devolver el producto o cancelar el servicio, o si proporcionaste un producto o servicio de sustitución.','If your customer was not refunded appropriately, you will need to accept the dispute, or resolve the issue with your customer. The credit card networks place liability for accepting disputed payments with you, the business.'=>'Si el cliente no recibió el reembolso adecuado, tendrás que aceptar la disputa o resolver el problema con él. Las redes de tarjetas de crédito asumen la responsabilidad de aceptar los pagos objeto de disputa ante ti, es decir, el negocio.','If your sales exceed the VAT threshold for your country, you\'re required to register for a VAT Number.'=>'Si tus ventas superan el umbral de IVA establecido para tu país, deberás registrarte para obtener un número de IVA.','In Progress'=>'En progreso','In admin renewal failed emailThe automatic recurring payment for order %1$s from %2$s has failed. The customer was sent an email requesting authentication of payment. If the customer does not authenticate the payment, they will be requested by email again %3$s.'=>'El pago automático recurrente para el pedido %1$s de %2$s ha fallado. Se ha enviado un correo electrónico al cliente para solicitarle la autenticación del pago. Si el cliente no autentifica el pago, se le volverá a solicitar por correo electrónico %3$s.','In failed renewal authentication emailThe automatic payment to renew your subscription with %1$s has failed. To reactivate the subscription, please login and authorize the renewal from your account page: %2$s'=>'El pago automático para renovar tu suscripción con %1$s ha fallado. Para reactivar la suscripción, inicia sesión y autoriza la renovación desde la página de tu cuenta: %2$s','In just a few moments, you\'ll be ready to test payments on your store.'=>'En unos instantes, podrás probar los pagos en tu tienda.','In order to receive payouts, you will need to provide your bank details.'=>'Para recibir cobros, tienes que proporcionar los detalles de tu cuenta bancaria.','In transit'=>'En tránsito','In your online bank account or from an ATM, choose "Payment and other services".'=>'En tu cuenta bancaria en línea o desde un cajero automático, elige «Pago y otros servicios».','In-Person'=>'En persona','In-Person (POS)'=>'En persona (punto de venta)','In-Person Card Payment'=>'Pago con tarjeta en persona','In-person transactions'=>'Transacciones en persona','Inactive'=>'Inactivo','Include timezone into date filtering.'=>'Incluye la zona horaria en el filtrado de fechas.','Incorrect account details'=>'Datos de la cuenta incorrectos','Increase conversion at checkout'=>'Aumenta la conversión en el momento del pago','Increase your store’s conversion by offering your customers preferred and convenient payment methods on checkout.'=>'Ofrece a los clientes sus métodos de pago preferidos al finalizar la compra para aumentar las conversiones de la tienda.','Indicates whether the transaction was made online or offline.'=>'Indica si la transacción se realizó en línea o fuera de línea.','Industry'=>'Sector','Information about the payment method, click to expand'=>'Haz clic para ampliar la información del método de pago','Inquiry: Closed'=>'Investigación: cerrada','Inquiry: Needs response'=>'Investigación: requiere respuesta','Inquiry: Under review'=>'Investigación: en revisión','Install WooCommerce'=>'Instalar WooCommerce','Instant payout'=>'Pago instantáneo','Instant payout date'=>'Fecha del pago instantáneo','Instant payout for %s in transit.'=>'Pago instantáneo de %s en tránsito.','Insufficient funds'=>'Fondos insuficientes','Intent creation failed with the following message: %s'=>'Se ha producido un error en la creación de la intención con el siguiente mensaje: %s','Intent id was not included for payment complete status change.'=>'El ID del intento no se ha incluido para el cambio de estado completado del pago.','Intentions require at least one payment method'=>'Para las intenciones, se debe establecer al menos un método de pago.','International IP Address'=>'Direcciones IP internacionales','International card fee: %1$s%%'=>'Tarifa por tarjeta internacional: %1$s%%','International card fee: %1$s%% + %2$s'=>'Tarifa por tarjeta internacional: %1$s%% + %2$s','International payment method fee'=>'Comisión por método de pago internacional','Invalid Refund Amount'=>'El importe de reembolso no es válido','Invalid express checkout method ID specified.'=>'El ID del método de pago exprés especificado no es válido.','Invalid number passed. Number %1$s needs to be larger than %2$s'=>'Se ha transmitido un número no válido. El número %1$s tiene que ser superior a %2$s','Invalid or missing payment details. Please ensure the provided payment method is correctly entered.'=>'Detalles de pago no disponibles o no válidos. Asegúrate de introducir correctamente el método de pago proporcionado.','Invalid order status'=>'Estado del pedido no válido','Invalid order!'=>'Pedido no válido.','Invalid payment intent'=>'Intento de pago no válido','Invalid phone number.'=>'Número de teléfono no válido.','Invalid product id'=>'ID de producto no válido','Invalid request'=>'Solicitud no válida.','Invalid saved payment method (token) ID.'=>'ID de método de pago (token) guardado no válido.','Invalid token: cookie and session customer mismatch'=>'Token no válido: cookie y sesión de cliente no coincidentes','Invalid value type; must be either boolean or array'=>'Tipo de valor no válido; debe ser booleano o array','Investigate this purchase and refund the transaction as needed.'=>'Comprueba esta compra y reembolsa la transacción si es necesario.','Ireland'=>'Irlanda','Is Not'=>'No es','Is my data safe with %s?'=>'¿Están mis datos seguros con %s?','Is the payment gateway ready and enabled for use on your store?'=>'¿Está la pasarela de pago preparada y activada para su uso en tu tienda?','Issue a full refund back to your customer\'s payment method using %s. This action can not be undone. To issue a partial refund, click "Cancel", and use the "Refund" button in the order details below.'=>'Emite un reembolso completo al método de pago de tu cliente mediante %s. Esta acción no se puede deshacer. Para emitir un reembolso parcial, haz clic en «Cancelar» y utiliza el botón «Reembolsar» que aparece en los detalles del pedido a continuación.','Issue a refund by <dueByDate/>.'=>'Emite un reembolso antes del <dueByDate/>.','Issue a refund?'=>'¿Desaas emitir un reembolso?','Issue an authorization on checkout, and capture later.'=>'Emite una autorización durante el pago y haz la captura más tarde.','Issue refund'=>'Emitir reembolso','Issuer evidence'=>'Evidencia del emisor','Issuing a refund will close the inquiry, returning the amount in question back to the cardholder. No additional fees apply.'=>'La emisión del reembolso cerrará la investigación. Se devolverá el importe en cuestión al titular de la tarjeta. No se aplican tasas adicionales.','It appears you\'re attempting to set up %1$s from an unsupported country. In order to complete the set up of %1$s, your store is required to have a business entity in one of the following countries: {{list /}} {{link}}Learn more{{/link}} about setting up business entities in foreign countries.'=>'Parece que estás intentando configurar %1$s desde un país no autorizado. Para poder completar la configuración de %1$s, tu tienda debe estar inscrita como entidad comercial en uno de estos países: {{list /}} {{link}}Obtén más información{{/link}} sobre cómo establecer entidades comerciales en el extranjero.','It has been refunded and is not a subject for disputes.'=>'Se ha reembolsado y no es objeto de disputa.','It may be more efficient—and provide a better customer experience—to accept an accidental dispute and charge the customer again, if appropriate. Even when a dispute is withdrawn, it usually takes approximately 75 days to be finalized. Remember, it doesn’t matter to the card networks whether you win or lose a dispute; what matters is how many disputes a business receives, regardless of how many disputes are won.'=>'Aceptar una disputa accidental y volver a cobrarle al cliente (si corresponde) puede ser más eficiente y ofrecer una mejor experiencia al cliente. Incluso cuando se retira una disputa, generalmente tarda unos 75 días en darse por finalizada. Recuerda que para las redes de tarjetas no importa si ganas o pierdes una disputa; lo que importa es cuántas disputas recibe un negocio, independientemente de las que se ganen.','Italy'=>'Italia','JCB'=>'JCB','JCB is now enabled on your store.'=>'JCB ya está habilitado en tu tienda.','Japan'=>'Japón','Klarna'=>'Klarna','Klarna inquiries may mean that the customer is trying to return their item(s). <a>Please see this document for more information</a>'=>'Las consultas de Klarna pueden significar que el cliente está intentando devolver sus artículos. <a>Para obtener más información, consulta este documento</a>','Large'=>'Grande','Large {{helpText}}(55 px){{/helpText}}'=>'Grande {{helpText}}(55 px){{/helpText}}','Last 12 months'=>'Los últimos 12 meses','Last 3 months'=>'Los últimos 3 mesesr','Last 4 digits of the SEPA Debit.'=>'Últimos 4 dígitos del débito SEPA.','Last 4 digits of the card.'=>'Últimos 4 dígitos de la tarjeta.','Last 4 weeks'=>'Últimas 4 semanas','Last 7 days'=>'Últimos 7 días','Last day of the month'=>'Último día del mes','Last day today'=>'Último día hoy','Last week to respond to %d of the disputes'=>'Última semana para responder a %d de las disputas','Latvia'=>'Letonia','Layout'=>'Estructura','Learn more'=>'Más información','Learn more about enabling additional payment methods.'=>'Obtén más información sobre la activación de métodos de pago adicionales.','Learn more about enabling payment methods'=>'Obtén más información sobre la activación de métodos de pago','Learn more about fraud protection'=>'Más información sobre la protección contra el fraude.','Learn more about instant payouts'=>'Más información sobre los pagos instantáneos','Learn more about payouts suspended'=>'Más información sobre la suspensión de pagos','Learn more about pending schedules'=>'Obtén más información sobre los plazos del calendario pendientes','Learn more about sandbox mode'=>'Obtén más información sobre el modo de pruebas','Learn more about test mode'=>'Más información sobre el modo de prueba','Leave a review'=>'Escribir una reseña','Leave blank for no limit'=>'Déjalo en blanco si no quieres que haya ningún límite','Legal name'=>'Razón social','Less than $250k'=>'Menos de 250.000 dólares','Let your customers pay with JCB, the only international payment brand based in Japan.'=>'Permite que tus clientes paguen con JCB, el único proveedor de pago internacional con sede en Japón.','Let your customers pay with major credit and debit cards without leaving your store.'=>'Permite a los clientes pagar con las principales tarjetas de crédito y débito, sin salir de tu tienda.','Let your customers switch between your enabled currencies'=>'Permite que los clientes