mber'=>'Número de suscripción','Subscription transaction fee: %1$s%%'=>'Cargo por transacción de la suscripción: %1$s%%','Subscription transaction fee: %1$s%% + %2$s'=>'Cargo por transacción de la suscripción: %1$s%% + %2$s','Subscription was made when WooPayments was in the live mode and cannot be renewed in the test mode.'=>'La suscripción se hizo cuando WooPayments estaba en el modo en vivo y no se puede renovar en el modo de prueba.','Subscription was made when WooPayments was in the test mode and cannot be renewed in the live mode.'=>'La suscripción se hizo cuando WooPayments estaba en el modo de prueba y no se puede renovar en el modo en vivo.','Subscriptions'=>'Suscripciones','Succeeded'=>'Se ha restablecido correctamente','Success! You can start using WooPayments in sandbox mode.'=>'¡Bien! Puedes empezar a utilizar WooPayments en modo de entorno de pruebas.','Support email'=>'Correo electrónico de soporte','Support email cannot be empty once it has been set before, please specify.'=>'El correo electrónico de soporte no puede estar vacío si ya se ha definido anteriormente; debes introducirlo.','Support for Sofort is ending soon. '=>'La disponibilidad de Sofort finalizará pronto. ','Support phone number'=>'Número de teléfono de soporte','Support phone number cannot be empty once it has been set before, please specify.'=>'El número de teléfono de soporte no puede estar vacío si ya se ha definido anteriormente; debes introducirlo.','Support phone number cannot be empty.'=>'El número de teléfono de soporte no puede estar vacío.','Supported'=>'Admitido','Supporting the WooCommerce community'=>'Cómo ayudar a la comunidad de WooCommerce','Sweden'=>'Suecia','Swedish krona'=>'Corona sueca','Swiss franc'=>'Franco suizo','Switzerland'=>'Suiza','TOTAL'=>'TOTAL','Take more control 🎚️'=>'Obtén más control 🎚️','Tap to Pay'=>'Tap to Pay','Tap to Pay on Android'=>'Tap to Pay on Android','Tap to Pay on iPhone'=>'Tap to Pay on iPhone','Tap to pay transaction fee: %1$s%%'=>'Toca