s! Your feedback helps us to continue to improve and deliver the best tools for your business.'=>'¡Gracias por compartir tu opinión sobre WooPayments! Tus comentarios nos ayudan a seguir mejorando y ofreciendo las mejores herramientas para tu negocio.','Thanks for using {site_url}!'=>'¡Gracias por usar {site_url}!','The %1$s fee has been deducted from your account, and the disputed amount returned to the cardholder. <a>Learn more about preventing disputes</a>.'=>'La tarifa %1$s se ha deducido de tu cuenta y el importe impugnado se ha devuelto al titular de la tarjeta. <a>Más información sobre la prevención de disputas</a>.','The %1$s method is not available in the current payment state (%2$s).'=>'El método %1$s no está disponible en el estado de pago actual (%2$s).','The %1$s version you have installed is not compatible with %2$s for a Czech Republic business. Please update %1$s to version 7.8 or above (you are using %3$s). You can do that via the <a1>the plugins page.</a1>'=>'La versión de %1$s que has instalado no es compatible con %2$s para los negocios de República Checa. Actualiza a la versión 7.8 de %1$s o a una posterior (estás usando %3$s). Puedes realizar esta acción a través de la <a1>página de plugins</a1>.','The %1$s version you have installed is not compatible with %2$s for a Hungarian business. Please update %1$s to version 7.8 or above (you are using %3$s). You can do that via the <a1>the plugins page.</a1>'=>'La versión de %1$s que has instalado no es compatible con %2$s para los negocios de Hungría. Actualiza a la versión 7.8 de %1$s o a una posterior (estás usando %3$s). Puedes realizar esta acción a través de la <a1>página de plugins</a1>.','The %1$s version you have installed is not compatible with %2$s for a Norwegian business. Please update %1$s to version 7.5 or above. You can do that via the <a1>the plugins page.</a1>'=>'La versión de %1$s que has instalado no es compatible con %2$s para los negocios de Noruega. Actualiza a la versión 7.5 de %1$s o a una posterior. Puedes realizar esta acción a través de la <a1>página de plugins</a1>.','The %1$s version you have installed is not compatible with %2$s for a Swedish business. Please update %1$s to version 7.8 or above (you are using %3$s). You can do that via the <a1>the plugins page.</a1>'=>'La versión de %1$s que has instalado no es compatible con %2$s para los negocios de Suecia. Actualiza a la versión 7.8 de %1$s o a una posterior (estás usando %3$s). Puedes realizar esta acción a través de la <a1>página de plugins</a1>.','The Importer Exporter Code (IEC) number could not be verified. Correct any errors in the company’s IEC number field. (India only)'=>'No se ha podido verificar el número del código de importación y exportación (IEC). Corrige los errores en el campo del número IEC de la empresa. (solo para la India)','The address on the account could not be verified. Correct any errors in the address field or upload a document that includes the address.'=>'No se ha podido verificar la dirección que aparece en la cuenta. Corrige los errores en el campo de la dirección o sube un documento que contenga esa dirección.','The address on the document did not match the address on the account. Upload a document with a matching address or update the address on the account.'=>'La dirección que figuraba en el documento no coincidía con la que aparece en la cuenta. Sube un documento con una dirección que coincida o actualiza la que aparece en la cuenta.','The address to which a physical product was shipped. The shipping address must match a billing address verified with AVS. (A signature is not required as evidence of delivery).'=>'La dirección a la que se envió un producto físico. La dirección de envío debe coincidir con una dirección de facturación verificada con AVS (no se requiere una firma como prueba de entrega).','The advanced fraud protection filters currently enabled.'=>'Los filtros avanzados de protección contra el fraude actualmente activados.','The amount of the transaction.'=>'El importe de la transacción.','The bank account details on file are probably incorrect. No bank account could be located with those details.'=>'Es probable que los datos bancarios registrados sean incorrectos. No se ha podido encontrar ninguna cuenta bancaria con esos datos.','The bank account details on file are probably incorrect. While the routing number appears correct, the account number is invalid.'=>'Es probable que los datos bancarios registrados sean incorrectos. Aunque el número de ruta parece correcto, el número de cuenta no es válido.','The bank account has been closed.'=>'La cuenta bancaria se ha cerrado.','The bank account has been frozen.'=>'La cuenta bancaria se ha congelado.','The bank account has restrictions on either the type or number of transfers allowed. This normally indicates that the bank account is a savings or other non-checking account.'=>'Hay restricciones en la cuenta bancaria en cuanto al tipo o número de transferencias permitidas. Generalmente, esto indica que la cuenta bancaria es una cuenta de ahorro o una cuenta que no es corriente.','The bank account holder name on file appears to be incorrect.'=>'Parece que el nombre del titular de la cuenta bancaria registrado es incorrecto.','The bank account type is incorrect. This value can only be checking or savings in most countries. In Japan, it can only be futsu or toza.'=>'El tipo de cuenta bancaria es incorrecto. Este valor solo puede ser de cuenta bancaria corriente o de ahorro en la mayoría de los países. En Japón, solo puede ser futsu o toza.','The bank could not process this transfer. Please check that the entered bank account details match the corresponding account bank statement exactly.'=>'El banco no ha podido procesar esta transferencia. Comprueba que los datos bancarios introducidos coincidan exactamente con el extracto bancario de la cuenta correspondiente.','The bank has declined this transfer. Please contact the bank for more information.'=>'El banco ha rechazado esta transferencia. Para obtener más información, ponte en contacto con el banco.','The bank no longer supports transfers to this card.'=>'El banco ya no admite que se hagan transferencias a esta tarjeta.','The bank or the payment processor could not process this transfer.'=>'El banco o el procesador de pagos no han podido procesar esta transferencia.','The bank was unable to process this transfer because of its currency. This is probably because the bank account cannot accept payments in that currency.'=>'El banco no ha podido procesar esta transferencia debido a su divisa. Esto se debe a que la cuenta bancaria no puede aceptar pagos en esa divisa.','The billing address does not match what is on file with the card issuer.'=>'La dirección de facturación no coincida con la que consta en el archivo del emisor de la tarjeta.','The business’s publicly available website.'=>'El sitio web público del negocio.','The card has expired'=>'La tarjeta ha caducado','The card has insufficient funds to complete the purchase'=>'La tarjeta no tiene los fondos suficientes para completar la compra','The card issuer has declined the transaction as it will exceed the card limit. Please switch to a different card or payment method. Contact the issuing bank for clarification.'=>'El emisor de la tarjeta ha rechazado la transacción porque superará el límite de la tarjeta. Utiliza otra tarjeta o método de pago. Ponte en contacto con el banco emisor para obtener más información.','The card number is incorrect'=>'El número de tarjeta es incorrecto','The card number is invalid'=>'El número de tarjeta no es válido','The card used has been reported lost or stolen. Please contact the issuing bank for clarification.'=>'Se ha denunciado la pérdida o el robo de la tarjeta utilizada. Ponte en contacto con el banco emisor para obtener más información.','The card used has expired. Please switch to a different card or payment method. Contact the issuing bank for clarification.'=>'La tarjeta que se ha utilizado ha caducado. Utiliza otra tarjeta o método de pago. Ponte en contacto con el banco emisor para obtener más información.','The card used was invalid. This usually means the card number is invalid or the account has been closed.'=>'La tarjeta que se ha utilizado no era válida. Generalmente, esto significa que el número de la tarjeta no es válido o que la cuenta se ha cerrado.','The card was declined by the bank'=>'El banco ha rechazado la tarjeta','The card\'s issuing bank cannot verify the CVV.'=>'El banco emisor de la tarjeta no puede verificar el CVV.','The cardholder claims a credit was not processed.'=>'El titular de la tarjeta afirma que no se ha tramitado un abono.','The cardholder claims a subscription was canceled.'=>'El titular de la tarjeta afirma que se ha cancelado una suscripción.','The cardholder claims the product was not received.'=>'El titular de la tarjeta afirma que no ha recibido el producto.','The cardholder claims the product was unacceptable.'=>'El titular de la tarjeta afirma que el producto era inaceptable.','The cardholder claims this is a duplicate transaction.'=>'El titular de la tarjeta afirma que se trata de una transacción duplicada.','The cardholder claims this is an unauthorized transaction.'=>'El titular de la tarjeta afirma que se trata de una transacción no autorizada.','The cardholder claims this is an unrecognized charge.'=>'El titular de la tarjeta afirma que se trata de un cargo no reconocido.','The cardholder\'s bank is requesting more information to decide whether to return these funds to the cardholder.'=>'El banco del titular de la tarjeta solicita más información para decidir si devolverá los fondos a dicho titular.','The charge ID for the previous payment that appears to be a duplicate of the one that is disputed.'=>'El ID de cargo del pago anterior que parece ser un duplicado del pago objeto de disputa.','The class %1$s is not a subclass of %2$s'=>'La clase %1$s no es una subclase de %2$s','The combination of the city, state, and postal code in the provided address could not be validated.'=>'No se ha podido validar la combinación de ciudad, estado y código postal de la dirección facilitada.','The company ID number on the account could not be verified. Correct any errors in the ID number field or upload a document that includes the ID number.'=>'No se ha podido verificar el número de identificación de la empresa que aparece en la cuenta. Corrige los errores en el campo del número de identificación o sube un documento que contenga ese número.','The company ID number was missing on the document. Upload a document that includes the ID number.'=>'En el documento faltaba el número de identificación de la empresa. Sube un documento que contenga el número de identificación.','The company address was missing on the document. Upload a document that includes the address.'=>'En el documento faltaba la dirección de la empresa. Sube un documento que contenga la dirección.','The company name on the account could not be verified. Correct any errors in the company name field or upload a document that includes the company name.'=>'No se ha podido verificar el nombre de la empresa que aparece en la cuenta. Corrige los errores en el campo del nombre de la empresa o sube un documento que contenga ese nombre.','The company name was missing on the document. Upload a document that includes the company name.'=>'En el documento faltaba el nombre de la empresa. Sube un documento que contenga el nombre de la empresa.','The corresponding wordpress.com blog ID for this store.'=>'El ID del blog de wordpress.com correspondiente a esta tienda.','The currency of the store.'=>'La moneda de la tienda.','The currency of the transaction.'=>'La moneda de la transacción.','The current fraud protection level the payment gateway is using.'=>'El nivel actual de protección contra el fraude que utiliza la pasarela de pago.','The current version of the %s extension.'=>'La versión actual de la extensión %s.','The customer claims that the purchased product was returned or the transaction was otherwise canceled, but you have not yet provided a refund or credit.'=>'El cliente afirma que devolvió el producto comprado o que la transacción se canceló por otro motivo, pero aún no has reembolsado o abonado el importe.','The customer claims that you continued to charge them after a subscription was canceled.'=>'El cliente afirma que seguiste cobrándole después de haber cancelado su suscripción.','The customer claims they did not receive the products or services purchased.'=>'El cliente afirma que no recibió los productos o servicios comprados.','The customer claims they were charged multiple times for the same product or service.'=>'El cliente afirma que le cobraron el mismo producto o servicio varias veces.','The customer doesn’t recognize the payment appearing on their card statement.'=>'El cliente no reconoce el pago que aparece en el extracto de la tarjeta.','The customer has notified their bank that this payment was unauthorized.'=>'El cliente ha notificado a su banco que este pago no estaba autorizado.','The customer id of the intent'=>'El identificador de cliente de la intención','The customer must authorize this payment via a notification sent to them by the bank which issued their card. The authorization must be completed before %1$s at %2$s, when the charge will be attempted.'=>'El cliente debe autorizar este pago mediante una notificación que le ha enviado el banco que ha emitido su tarjeta. La autorización se debe completar antes del %1$s a las %2$s, cuando se intentará pasar al cobro.','The customer\'s account has insufficient funds to cover this payment.'=>'La cuenta del cliente no tiene fondos suficientes para cubrir este pago.','The customer\'s bank account could not be located.'=>'No se ha podido encontrar la cuenta bancaria del cliente.','The customer\'s bank account has been closed.'=>'La cuenta bancaria del cliente se ha cerrado.','The customer\'s bank could not send pre-debit notification for the payment.'=>'El banco del cliente no ha podido enviar una notificación pre-débito para el pago.','The customer-facing business name.'=>'El nombre del negocio de cara al cliente.','The date and time when the transaction was created.'=>'Fecha y hora de creación de la transacción.','The date of birth (DOB) on the document did not match the DOB on the account. Upload a document with a matching DOB or update the DOB on the account.'=>'La fecha de nacimiento que figuraba en el documento no coincidía con la que aparece en la cuenta. Sube un documento con una fecha que coincida o actualiza la que aparece en la cuenta.','The date on which a physical product began its route to the shipping address. This date should be prior to the date of the dispute.'=>'La fecha en la que un producto físico empezó la ruta a la dirección de envío. Esta fecha debe ser anterior a la fecha de la disputa.','The date on which the cardholder received or began receiving the purchased service.'=>'La fecha en la que el titular de la tarjeta recibió o empezó a recibir el servicio comprado.','The date when the payment intent was created.'=>'Fecha de creación de la intención de pago.','The delivery service that shipped a physical product, such as Fedex, UPS, USPS, etc. If multiple carriers were used for this purchase, please separate them with commas.'=>'El servicio de envío que envió un producto físico, como Fedex, UPS, USPS, etc. Si se usaron varias empresas de transporte para la compra, sepáralas con comas.','The destination bank account is no longer valid because its branch has changed ownership.'=>'La cuenta bancaria de destino ya no es válida porque su sucursal ha cambiado de propietario.','The disputed charge has been refunded.'=>'El cargo objeto de disputa se ha reembolsado.','The document could not be read. Ensure that the document follows the <a>guidelines for document uploads</a>.'=>'El documento no se ha podido leer. Comprueba que el documento sigue las <a>instrucciones para la subida de documentos</a>.','The document could not be used for verification because it has expired. If it’s an identity document, its expiration date must be after the date the document was submitted. If it’s an address document, the issue date must be within the last six months.'=>'El documento no se ha podido utilizar para la verificación porque ha vencido. Si se trata de un documento de identidad, la fecha de caducidad debe ser posterior a la fecha de presentación del documento. Si se trata de un documento para la dirección, la fecha de expedición debe ser de los últimos seis meses.','The document could not be used for verification because it was in greyscale. Upload a color copy of the document.'=>'El documento no se ha podido utilizar para la verificación porque estaba en escala de grises. Sube una copia en color del documento.','The document could not be verified because it was detected as a copy (e.g., photo or scan). Upload the original document.'=>'No se ha podido verificar el documento porque se ha detectado que es una copia (por ejemplo, una foto o una copia escaneada). Sube el documento original.','The document could not be verified for an unknown reason. Ensure that the document follows the <a>guidelines for document uploads</a>'=>'El documento no se ha podido verificar por motivos desconocidos. Comprueba que el documento sigue las <a>instrucciones para la subida de documentos</a>.','The document could not be verified. Upload a document that includes the company name, ID number, and address fields.'=>'El documento no se ha podido verificar. Sube un documento que contenga los campos de nombre de la empresa, número de identificación y dirección.','The document was cropped or missing important information. Upload a complete scan of the document.'=>'El documento estaba recortado o le faltaba información importante. Sube el documento escaneado por completo.','The document was identified as altered or falsified.'=>'Se detectó que el documento estaba alterado o se había falsificado.','The exchange rate of the transaction.'=>'El tipo de cambio de la transacción.','The existing terms of service signature has been invalidated because the account’s tax ID has changed. The account needs to accept the terms of service again. For more information, see <a>this documentation</a>.'=>'La firma de las condiciones del servicio actual se ha invalidado porque el número de identificación fiscal de la cuenta ha cambiado. Se deben aceptar de nuevo las condiciones del servicio en la cuenta. Para obtener más información, consulta <a>esta documentación</a>.','The expiration month is invalid'=>'El mes de caducidad no es válido','The expiration year is invalid'=>'El año de caducidad no es válido','The express checkout is not supported in %s because some required fields couldn\'t be verified. Please proceed to the checkout page and try again.'=>'La función Express Checkout no está disponible en %s porque algunos campos obligatorios no se han podido verificar. Accede a la página de pago y vuelve a intentarlo.','The file you have attached is exceeding the maximum limit.'=>'El archivo que has adjuntado supera el límite máximo.','The files you\'ve attached to this dispute as evidence will exceed the limit for a dispute\'s total size. Try using smaller files as evidence. Hint: if you\'ve attached images, you might want to try providing them in lower resolutions.'=>'Los archivos que has adjuntado a esta disputa, como evidencia, exceden el tamaño total permitido para una disputa. Prueba a usar archivos más pequeños como evidencia. Consejo: si has adjuntado imágenes, puedes probar a bajarles la resolución.','The identifier of the WooCommerce order associated with this transaction.'=>'El identificador del pedido de WooCommerce asociado a esta transacción.','The information you provide here will be used for all of your account\'s tax documents.'=>'La información que has facilitado aquí se utilizará para todos los documentos fiscales de tu cuenta.','The issue or expiry date is missing on the document. Upload a document that includes the issue and expiry dates.'=>'En el documento falta la fecha de expedición o de caducidad. Sube un documento que contenga las fechas de expedición y caducidad.','The issuer specified by the card number does not exist. Please verify card details.'=>'El emisor especificado por el número de la tarjeta no existe. Verifica los detalles de la tarjeta.','The issuing bank is currently unavailable. Our system will automatically try again on your next payout date, or you can switch to a different payout method.'=>'El banco emisor no está disponible actualmente. Nuestro sistema volverá a intentarlo automáticamente en la próxima fecha de pago o puedes cambiar a otro método de pago.','The keyed-in information on the account could not be verified. Correct any errors in the company name, ID number, or address fields. You can also upload a document that includes those fields.'=>'No se ha podido verificar la información introducida en la cuenta. Corrige los errores en los campos del nombre de la empresa, el número de identificación o la dirección. También tienes la opción de subir un documento que contenga esos campos.','The mandate used for this renewal payment is invalid. You may need to bring the customer back to your store and ask them to resubmit their payment information.'=>'El poder utilizado para este pago de renovación no es válido. Puede que tengas que pedir al cliente que vuelva a la tienda y que envíe de nuevo su información de pago.','The merchant account ID you are currently using to process payments with.'=>'El ID de la cuenta de vendedor que estás utilizando actualmente para procesar los pagos.','The minimum amount that can be processed is %1$s %2$s.'=>'El importe mínimo que se puede procesar es de %1$s %2$s.','The minimum amount to capture is %s.'=>'El importe mínimo que se puede capturar es de %s .','The name on the document did not match the name on the account. Upload a document with a matching name or update the name on the account.'=>'El nombre que figuraba en el documento no coincidía con el que aparece en la cuenta. Sube un documento con un nombre que coincida o actualiza el que aparece en la cuenta.','The nationality on the document did not match the person’s stated nationality. Update the person’s stated nationality, or upload a document that matches it.'=>'La nacionalidad que figuraba en el documento no coincidía con la indicada por la persona. Actualiza la nacionalidad indicada por la persona o sube un documento que coincida con ella.','The number of subscriptions migrated from Stripe Billing to on-site billing.'=>'El número de suscripciones migradas de Stripe Billing a la facturación interna.','The number of subscriptions using Stripe Billing'=>'El número de suscripciones que usan Stripe Billing','The order could not be found.'=>'No se ha podido encontrar el pedido.','The payment amount is too small to be processed.'=>'El importe del pago no es suficiente para poder procesarse.','The payment cancellation failed to complete.'=>'No se ha podido completar la cancelación del pago.','The payment cannot be canceled'=>'El pago no puede cancelarse','The payment cannot be captured'=>'No se puede capturar el pago','The payment cannot be captured for completed or processed orders.'=>'El pago no puede capturarse para pedidos completados o procesados.','The payment cannot be processed due to a mismatch with order details.'=>'No se puede procesar el pago porque los datos del pedido no coinciden.','The payment capture failed to complete.'=>'No se ha podido capturar el pago.','The payment for this order has not yet been passed to the fraud and risk filters to determine its outcome status.'=>'El pago de este pedido aún no ha pasado por los filtros de fraude y riesgo para determinar su estado de resolución.','The payment for this order passed your risk filtering.'=>'El pago de este pedido ha superado tu filtro de riesgos.','The payment for this order was blocked by your risk filtering. There is no pending authorization, and the order can be cancelled to reduce any held stock.'=>'Tu filtro de riesgos ha bloqueado el pago de este pedido. No hay ninguna autorización pendiente, y el pedido se puede cancelar para reducir las existencias retenidas.','The payment for this order was done in person and has bypassed your risk filtering.'=>'El pago de este pedido se realizó en persona y ha eludido tu filtro de riesgos.','The payment for this order was held for review by your risk filtering and manually approved.'=>'El filtro de riesgos ha retenido el pago de este pedido para su revisión y se ha aprobado manualmente.','The payment for this order was held for review by your risk filtering. The authorization for the charge appears to have expired.'=>'El filtro de riesgos ha retenido el pago de este pedido para su revisión. Parece que la autorización para el cargo ha caducado.','The payment for this order was held for review by your risk filtering. The authorization for the charge appears to have failed.'=>'El filtro de riesgos ha retenido el pago de este pedido para su revisión. Parece que la autorización para el cargo ha fallado.','The payment for this order was held for review by your risk filtering. You can review the details and determine whether to approve or block the payment.'=>'Tu filtro de riesgos ha retenido el pago de este pedido para su revisión. Puedes revisar los detalles y determinar si apruebas o bloqueas el pago.','The payment info couldn\'t be added to the order.'=>'No se pudo añadir al pedido la información de pago.','The payment method ID used to create the transaction type.'=>'El ID del método de pago utilizado para crear el tipo de transacción.','The payment method will not be charged until you review and approve the transaction.'=>'No se cobrará el importe en el método de pago hasta que revises y apruebes la transacción.','The payment requires authentication'=>'El pago requiere autenticación','The payment was declined'=>'Se ha rechazado el pago','The payment will be blocked.'=>'El pago se bloqueará.','The person’s keyed-in identity information could not be verified. Correct any errors or upload a document that matches the identity fields (e.g., name and date of birth) entered.'=>'No se ha podido verificar la información identificativa de la persona introducida en la cuenta. Corrige los errores o sube un documento que coincida con los campos sobre la identidad (por ejemplo, nombre y fecha de nacimiento).','The postal code is incorrect'=>'El código postal es incorrecto','The product or service was received but was defective, damaged, or not as described.'=>'El producto o el servicio se recibieron, pero eran defectuosos, presentaban daños o no eran conformes a lo descrito.','The provided document type was not accepted. Ensure that the document follows the <a>guidelines for document uploads</a>.'=>'El tipo de documento proporcionado no se ha aceptado. Comprueba que el documento sigue las <a>instrucciones para la subida de documentos</a>.','The provided document was from an unsupported country.'=>'El documento proporcionado procedía de un país no admitido.','The refund amount is not valid for charge ID: %1$s'=>'El importe del reembolso no es válido para el ID de cargo: %1$s','The refund amount is not valid.'=>'El importe del reembolso no es válido.','The renewal order is as follows:'=>'El pedido de renovación es el siguiente:','The representative must have an address in the same country as the company.'=>'El representante debe tener una dirección en el mismo país que la empresa.','The requested order (ID %d) was not found.'=>'No se ha encontrado el pedido solicitado (ID %d).','The requested order was not found.'=>'No se ha encontrado el pedido solicitado.','The same type of document was used twice. Two unique types of documents are required for verification. Upload two different documents.'=>'Se ha utilizado el mismo tipo de documento dos veces. Para la verificación, es obligatorio presentar dos tipos únicos de documentos. Sube dos documentos distintos.','The saved payment method selected does not belong to this order\'s customer.'=>'El método de pago guardado que has seleccionado no pertenece al cliente de este pedido.','The saved payment method selected is invalid or does not exist.'=>'El método de pago guardado que has seleccionado no es válido o no existe.','The search parameter must be a string, or an array of strings.'=>'El parámetro de búsqueda debe ser una cadena o un array de cadenas.','The security code is incorrect'=>'El código de seguridad es incorrecto','The security code is invalid'=>'El código de seguridad no es válido','The selected card has exceeded its card usage frequency limit. Please switch to a different card or payment method. Contact the issuing bank for clarification.'=>'La tarjeta que has seleccionado ha superado el límite de uso. Utiliza otra tarjeta o método de pago. Ponte en contacto con el banco emisor para obtener más información.','The selected currency is not available for the country set in your %s account.'=>'La moneda seleccionada no está disponible para el país configurado en tu cuenta de %s.','The selected payment method requires a total amount of at least %s.'=>'El método de pago seleccionado requiere un importe total de al menos %s.','The status of the deposit'=>'El estado del depósito','The status of the payment intent.'=>'El estado de la intención de pago.','The store currency was recently changed. The following currencies are set to manual rates and may need updates: %s'=>'La moneda de la tienda se ha cambiado recientemente. Las siguientes monedas se han configurado con tipos de cambio manuales y es posible que necesiten ponerse al día: %s','The street name and/or number for the provided address could not be validated.'=>'No se ha podido validar el nombre o el número de la calle de la dirección facilitada.','The subscription couldn\'t be created because it uses a different currency (%1$s) from your existing subscriptions (%2$s). Please ensure all subscriptions use the same currency.'=>'La suscripción no se ha podido crear porque usa una moneda distinta (%1$s) a la de tus suscripciones actuales (%2$s). Confirma que todas las suscripciones usan la misma moneda.','The tax ID on the account cannot be verified by the IRS. Either correct any possible errors in the company name or tax ID, or upload a document that contains those fields.'=>'El Servicio de Impuestos Internos de Estados Unidos (IRS) no puede verificar el número de identificación fiscal que aparece en la cuenta. Corrige los posibles errores en el nombre de la empresa o el número de identificación fiscal, o sube un documento que contenga esos campos.','The tax ID on the account was not recognized by the IRS. Refer to the support article for <a>newly-issued tax ID numbers</a>.'=>'El Servicio de Impuestos Internos de Estados Unidos (IRS) no ha reconocido el número de identificación fiscal que aparece en la cuenta. Consulta el artículo de soporte para conocer los <a>nuevos números de identificación fiscal emitidos</a>.','The timing and amount of your payouts may vary due to several factors. Check out our {{link}}payout schedule guide{{/link}} for details.'=>'La fecha y la cantidad de tus pagos pueden variar en función de diversos factores. Échale un vistazo a nuestra {{link}}guía sobre la programación de pagos{{/link}} para obtener más información.','The tracking number (if available) for a physical product, obtained from the delivery service. If multiple tracking numbers were generated for this purchase, please separate them with commas. When we compile your evidence into a single document, these tracking numbers will be expanded to include detailed delivery information from the carrier.'=>'El número de seguimiento (si está disponible) de un producto físico, proporcionado por el servicio de envío. Si se generaron varios números de seguimiento para la compra, sepáralos con comas. Cuando reúnas las pruebas en un solo documento, a los números de seguimiento se deberán añadir los datos del envío detallados de la empresa de transporte.','The transfer was refused by the card issuer. Please contact the issuing bank for clarification.'=>'El emisor de la tarjeta ha rechazado la transferencia. Ponte en contacto con el banco emisor para obtener más información.','The transfer was refused by the issuing bank because this type of payment is not permitted for this card. Please contact the issuing bank for clarification.'=>'El banco emisor ha rechazado la transferencia porque este tipo de pago no es compatible con esta tarjeta. Ponte en contacto con el banco emisor para obtener más información.','The type of the transaction.'=>'El tipo de transacción.','The ultimate goal of the “Know Your Customer” process is to help your business get up and running with payments as soon as possible while protecting your business and your customers. We follow the same regulations as other financial institutions so that we can ensure we operate in an ethical and trustworthy manner. We want to protect your business and the payments that we manage for you. The “Know Your Customer” process helps us protect you.'=>'El objetivo final del proceso "Conoce a tu cliente" es ayudar a tu negocio a ponerse en marcha y funcionar con pagos lo antes posible mientras protege tu negocio y a tus clientes. Seguimos las mismas normas que otras instituciones financieras, por lo que podemos asegurar que operamos de manera ética y fiable. Queremos proteger tu negocio y los pagos que gestionamos por ti. El proceso "Conoce a tu cliente" nos ayuda a protegerte.','The uploaded file exceeded the 10 MB size limit. Resize the document and upload the new file.'=>'El archivo subido supera el límite de tamaño de 10 MB. Cambia el tamaño del documento y sube el archivo nuevo.','The uploaded file for the document was invalid or corrupt. Upload a new file of the document.'=>'El archivo subido para el documento no era válido o estaba dañado. Sube un archivo nuevo del documento.','The uploaded file was missing the back of the document. Upload a complete scan of the document.'=>'Al archivo subido le faltaba el reverso del documento. Sube el documento escaneado por completo.','The uploaded file was missing the front of the document. Upload a complete scan of the document.'=>'Al archivo subido le faltaba el anverso del documento. Sube el documento escaneado por completo.','The uploaded file was not one of the valid document types. Ensure that the document follows the <a>guidelines for document uploads</a>.'=>'El archivo subido no era uno de los tipos de documento válidos. Comprueba que el documento sigue las <a>instrucciones para la subida de documentos</a>.','The version of Jetpack installed is too old to be used with %1$s. %1$s has been disabled. Please deactivate or update Jetpack.'=>'La versión de Jetpack instalada es demasiado antigua para utilizarla con %1$s. %1$s se ha desactivado. Desactiva o actualiza Jetpack.','Theme'=>'Tema','There are legitimate reasons for a billing/shipping mismatch with a customer purchase, but a mismatch could also indicate that someone is using a stolen identity to complete a purchase.'=>'Existen motivos legítimos para que los datos de facturación o envío no coincidan con los de la compra de un cliente. Sin embargo, una discrepancia también podría ser un indicio de que alguien está utilizando una identidad robada para hacer una compra.','There are unsaved changes on this page. Are you sure you want to leave and discard the unsaved changes?'=>'Hay cambios sin guardar en esta página. ¿Seguro que quieres salir y descartar los cambios sin guardar?','There has been an error accepting the dispute. Please try again later.'=>'Se ha producido un error al aceptar la disputa. Por favor, inténtalo de nuevo más tarde.','There has been an error canceling the payment for order #%s.'=>'Se ha producido un error al cancelar el pago del pedido n.º %s.','There has been an error capturing the payment for order #%s.'=>'Se ha producido un error al capturar el pago del pedido n.º %s.','There has been an error refunding the payment #%s. Please try again later.'=>'Ha habido un error al reembolsar el pago número %s. Inténtalo de nuevo más tarde.','There is %d customer subscription using Stripe Billing for subscription renewals. We suggest migrating it to on-site billing powered by the %s plugin. {{learnMoreLink}}Learn more{{/learnMoreLink}}'=>'Hay %d suscripción de clientes que usa Stripe Billing para la renovación de la suscripción. Recomendamos migrarla a la facturación interna generada por el plugin %s. {{learnMoreLink}}Más información{{/learnMoreLink}}' . "\0" . 'Hay %d suscripciones de clientes que usan Stripe Billing para el procesamiento de pagos. Recomendamos migrarlas a la facturación interna generada por el plugin %s. {{learnMoreLink}}Más información{{/learnMoreLink}}','There is a newer version of WooCommerce Admin bundled with WooCommerce.'=>'Hay una versión más reciente de WooCommerce Admin que integra WooCommerce.','There is currently %d customer subscription using Stripe Billing for payment processing. This subscription will be automatically migrated to use the on-site billing engine built into %s once Stripe Billing is disabled. {{learnMoreLink}}Learn more{{/learnMoreLink}}'=>'Actualmente, hay %d suscripción de clientes que usa Stripe Billing para el procesamiento de pagos. Esta suscripción se migrará automáticamente para que use el motor de facturación interna integrado en %s cuando Stripe Billing se haya desactivado. {{learnMoreLink}}Más información{{/learnMoreLink}}' . "\0" . 'Actualmente, hay %d suscripciones de clientes que usan Stripe Billing para el procesamiento de pagos. Estas suscripciones se migrarán automáticamente para que usen el motor de facturación interna integrado en %s cuando Stripe Billing se haya desactivado. {{learnMoreLink}}Más información{{/learnMoreLink}}','There was a duplicate attempt to initiate account setup. Please wait a few seconds and try again.'=>'Ha habido un intento duplicado de iniciar la configuración de la cuenta. Espera unos segundos e inténtalo de nuevo.','There was a problem connecting your store to WordPress.com: "%s"'=>'Se ha producido un problema al conectar tu tienda con WordPress.com: "%s"','There was a problem creating your subscription. %1$s doesn\'t meet the %2$sminimum recurring amount%3$s this payment method can process.'=>'Hubo un problema al crear la suscripción. %1$s no cumple con el %2$simporte mínimo recurrente%3$s que este método de pago puede procesar.','There was a problem creating your subscription. Please try again or contact us for assistance.'=>'Se ha producido un problema al crear tu suscripción. Inténtalo de nuevo o ponte en contacto con nosotros si necesitas ayuda.','There was a problem generating your export.'=>'Se ha producido un problema al generar la exportación.','There was a problem processing the order.'=>'Se ha producido un error al procesar el pedido.','There was a problem processing the payment. Please check your email inbox and refresh the page to try again.'=>'Se ha producido un error al procesar el pago. Comprueba la bandeja de entrada de tu correo electrónico y actualiza la página para volver a intentarlo.','There was a problem processing your account data. Please try again.'=>'Se ha producido un problema al procesar los datos de tu cuenta. Inténtalo de nuevo.','There was a problem redirecting you to the account dashboard. Please try again.'=>'Se ha producido un problema al redirigirte al escritorio de tu cuenta. Inténtalo de nuevo.','There was a problem redirecting you to the loan offer. Please check that it is not expired and try again.'=>'Se ha producido un problema al redirigirte a la oferta de préstamo. Comprueba que no haya caducado y vuelve a intentarlo.','There was a problem redirecting you to the requested link. Please check that it is valid and try again.'=>'Se ha producido un problema al redirigirte al enlace solicitado. Comprueba que sea válido e inténtalo de nuevo.','There was a problem resetting your account. Please wait a few seconds and try again.'=>'No se ha podido restablecer tu cuenta. Espera un poco e inténtalo de nuevo.','There was a problem setting up your %s account. Please try again.'=>'No se ha podido configurar tu cuenta de %s. Inténtalo de nuevo.','There was an error accessing document %1$s. %2$s'=>'Se ha producido un error al acceder al documento %1$s. %2$s','There was an error applying the promotion. Please contact support for assistance if the problem persists'=>'Se ha producido un error al aplicar la promoción. Si el problema persiste, ponte en contacto con el equipo de soporte.','There was an error getting the product information.'=>'Se ha producido un error al obtener la información del producto.','There was an error getting your inbox. Please try again.'=>'Ha ocurrido un error al acceder a la bandeja de entrada. Inténtalo de nuevo.','There was an error processing the product with this payment method. Please add the product to the cart, instead.'=>'Se ha producido un error al procesar el producto con este método de pago. Añade el producto al carrito.','There was an error rendering this view. Please contact support for assistance if the problem persists.'=>'Se ha producido un error al presentar esta vista previa. Si el problema continúa, ponte en contacto con el equipo de soporte.','There was an error retrieving your fraud protection settings. Please refresh the page to try again.'=>'Se ha producido un error al recuperar los ajustes de la protección contra el fraude. Actualiza la página para intentarlo de nuevo.','There was an error while processing this request. If you continue to see this notice, please contact the admin.'=>'Se ha producido un error al procesar esta solicitud. Si sigues viendo este aviso, ponte en contacto con el administrador.','These settings can be changed any time by visiting the Multi-Currency settings'=>'Estos ajustes se pueden modificar en cualquier momento en la configuración de la multidivisa','These settings will also apply to the %s on your store.'=>'Esta configuración también se aplicará a los botones de %s de tu tienda.','This action is final and cannot be undone.'=>'Esta acción es definitiva y no puede deshacerse.','This dispute was accepted and lost on %1$s.'=>'Esta disputa se aceptó y se perdió el %1$s.','This dispute was lost on %1$s due to non-response.'=>'Esta disputa se perdió el %1$s por falta de respuesta.','This dispute was lost on %1$s.'=>'Esta disputa se perdió el %1$s.','This filter checks the security code submitted by the customer against the data on file with the card issuer.'=>'Este filtro coteja el código de seguridad que ha enviado el cliente con los datos que constan en el archivo del emisor de la tarjeta.','This filter compares the amount of items in an order to the minimum and maximum counts that you specify.'=>'Este filtro compara la cantidad de artículos de un pedido con la cantidad mínima y máxima que has especificado.','This filter compares the purchase price of an order to the minimum and maximum purchase amounts that you specify.'=>'Este filtro compara el precio de compra de un pedido con los importes de compra mínimos y máximos que has especificado.','This filter compares the street number and the post code submitted by the customer against the data on file with the card issuer.'=>'Este filtro coteja el número de la calle y el código postal que ha enviado el cliente con los datos que constan en el archivo del emisor de la tarjeta.','This filter is disabled because you\'re currently selling to all countries.'=>'Este filtro está desactivado porque actualmente vendes a todos los países.','This filter is disabled, and can not be modified.'=>'Este filtro está desactivado y no se puede modificar.','This filter screens for customer\'s {{ipAddressLink}}IP address{{/ipAddressLink}} to see if it is in a different country than indicated in their billing address.'=>'Este filtro comprueba si la {{ipAddressLink}}dirección IP{{/ipAddressLink}} del cliente se encuentra en un país distinto al indicado en su dirección de facturación.','This filter screens for differences between the shipping information and the billing information (country).'=>'Este filtro busca las diferencias entre la información de envío y la información de facturación (país).','This filter screens for {{ipAddressLink}}IP addresses{{/ipAddressLink}} outside of your {{supportedCountriesLink}}supported countries{{/supportedCountriesLink}}.'=>'Este filtro busca {{ipAddressLink}}direcciones IP{{/ipAddressLink}} fuera de los {{supportedCountriesLink}}países admitidos{{/supportedCountriesLink}}.','This info will help us speed up the set up process.'=>'Esta información nos ayudará a agilizar el proceso de configuración.','This info will verify your account'=>'Esta información verificará tu cuenta','This inquiry was closed on %s. <a>Learn more about preventing disputes</a>.'=>'Esta investigación se cerró el %s. <a>Más información sobre la prevención de disputas</a>.','This is an uncategorized dispute, so you should contact the customer for additional details to find out why the payment was disputed.'=>'Esta es una disputa sin clasificar, por lo que debes ponerte en contacto con el cliente para pedirle más datos con el fin de averiguar por qué el pago dio lugar a la disputa.','This is the most common reason for a dispute, and happens when a cardholder claims that they didn’t authorize the payment. This can happen if the card was lost or stolen and used to make an unauthorized transaction. It can also happen if the cardholder doesn’t recognize the payment as it appears on the billing statement from their card issuer.'=>'Este es el motivo de disputa más habitual y se produce cuando el titular de una tarjeta afirma que no autorizó el pago. Puede ocurrir si la tarjeta se ha perdido o la han robado y utilizado para llevar a cabo una transacción no autorizada. También puede ocurrir si el titular de la tarjeta no reconoce el pago tal como aparece en el extracto de facturación enviado por el emisor de la tarjeta.','This is the receipt for your order #%s:'=>'Este es el recibo de tu pedido n.º %s:','This may be visible on receipts, invoices, and automated emails from your store.'=>'Este dato podría mostrarse en recibos, facturas y correos electrónicos automatizados de tu tienda.','This option will set up %s in sandbox mode. You can use our test data to set up. When you’re ready to launch your store, switching to live payments is easy.'=>'Esta opción configurará %s en modo de entorno de pruebas. Puedes utilizar nuestros datos de prueba para la configuración. Una vez lo tienes todo a punto para lanzar tu tienda, cambiar a los pagos en tiempo real es fácil.','This order does not require payment!'=>'Este pedido no requiere ningún pago.','This order has a high risk of being fraudulent. We suggest contacting the customer to confirm their details before fulfilling it.'=>'Este pedido tiene un alto riesgo de ser fraudulento. Te sugerimos que te pongas en contacto con el cliente para confirmar sus datos antes de tramitarlo.','This order has a moderate risk of being fraudulent. We suggest contacting the customer to confirm their details before fulfilling it.'=>'Este pedido tiene un riesgo moderado de ser fraudulento. Te sugerimos que te pongas en contacto con el cliente para confirmar sus datos antes de tramitarlo.','This order has a payment dispute for %1$s for the reason \'%2$s\'. '=>'Este pedido tiene un pago en disputa para %1$s por el motivo "%2$s". ','This order has an active payment dispute. Refunds and order editing are disabled.'=>'Este pedido tiene una disputa de pago activa. Los reembolsos y la edición de pedidos están desactivados.','This order has been {{authorizedNotCaptured/}} yet. Changing the status to {{newOrderStatus/}} will also {{cancelAuthorization/}}. Do you want to continue?'=>'Este pedido ya se ha {{authorizedNotCaptured/}}. Cambiar el estado a {{newOrderStatus/}} también {{cancelAuthorization/}}. ¿Quieres continuar?','This order has been {{authorizedNotCaptured/}} yet. Changing the status to {{newOrderStatus/}} will also {{captureAuthorization/}}. Do you want to continue?'=>'Este pedido ya se ha {{authorizedNotCaptured/}}. Cambiar el estado a {{newOrderStatus/}} también {{captureAuthorization/}}. ¿Quieres continuar?','This payment cannot be processed in its current state.'=>'No se puede procesar el pago en su estado actual.','This payment is not captured yet. To cancel this order, please go to \'Order Actions\' > \'Cancel authorization\'. To proceed with a refund, please go to \'Order Actions\' > \'Capture charge\' to charge the payment card, and then trigger a refund via the \'Refund\' button.'=>'El pago todavía no se ha capturado. Para cancelar este pedido, ve a "Acciones de pedido" > "Cancelar autorización". Para proceder con un reembolso, ve a "Acciones de pedido" > "Capturar cargo" para hacer un cargo en la tarjeta de pago y, luego, activa un reembolso mediante el botón "Reembolso".','This payment method cannot be saved for future use.'=>'Este método de pago no se puede guardar para un uso futuro.','This payment method is enabled by other extensions. {{reviewExtensions}}Review extensions{{/reviewExtensions}} to improve the shopper experience.'=>'Este método de pago se activa con otras extensiones. {{reviewExtensions}}Revisa las extensiones{{/reviewExtensions}} para mejorar la experiencia de compra.','This payment method is pending approval. Once approved, you will be able to use it.'=>'Este método de pago está pendiente de ser aprobado. Cuando se haya aprobado, podrás utilizarlo.','This payment shows a lower than normal risk of fraudulent activity.'=>'Este pago presenta un riesgo de actividad fraudulenta inferior al normal.','This represents the fee %s collects for the transaction.'=>'Representa la tarifa que %s cobra por la transacción.','This subscription has been successfully migrated to a WooPayments tokenized subscription.'=>'Esta suscripción se ha migrado correctamente a una suscripción con token de WooPayments.','This tool will clear the account cached values used in %s.'=>'Esta herramienta borrará los valores en caché de la cuenta que se utilizan en %s.','This tool will migrate all Stripe Billing subscriptions to tokenized subscriptions with WooPayments.%1$sNumber of Stripe Billing subscriptions found: %2$d'=>'Esta herramienta migrará todas las suscripciones de Stripe Billing a suscripciones tokenizadas con WooPayments.%1$sNúmero de suscripciones a Stripe Billing encontradas: %2$d','This transaction is not connected to order. '=>'Esta transacción no está conectada al pedido. ','This transaction was held for review by your risk filters, and the charge was manually blocked after review.'=>'Los filtros de riesgo han retenido esta transacción para revisarla, y el cargo se ha bloqueado manualmente tras la revisión.','This transaction will be included in an upcoming automated payout. The date of the payout will be displayed here once it is scheduled. {{learnMoreLink}}Learn more{{/learnMoreLink}}'=>'Esta transacción se incluirá en un próximo pago automático. La fecha del pago se mostrará aquí una vez programado. {{learnMoreLink}}Más información{{/learnMoreLink}}','This will issue a full refund of {{strong}}%s{{/strong}} to the customer.'=>'Con esto, se emitirá un reembolso completo de {{strong}}%s{{/strong}} para el cliente.','This will take place in a secure environment through our partner. Once your business details are verified, you’ll be redirected back to your store dashboard.'=>'Se llevará a cabo en un entorno seguro con la ayuda de nuestro socio. Cuando los detalles de tu negocio se verifiquen, se te redireccionará de nuevo al panel de administración de tu tienda.','Thursday'=>'jueves','Timeline'=>'Línea de tiempo','Title'=>'Título:','To add new currencies to your store, please finish setting up %s.'=>'Para añadir nuevas monedas a tu tienda, termina de configurar %s.','To complete your transaction with **the selected payment method**, you must log in or create an account with our site.'=>'Para completar la transacción con **el método de pago seleccionado**, debes iniciar sesión o crear una cuenta en nuestro sitio.','To continue using %s, please review and agree to our {{link}}Terms of Service{{/link}}. By clicking “Accept” you agree to the Terms of Service.'=>'Para seguir utilizando %s, lee y acepta nuestras {{link}}Condiciones del servicio{{/link}}. Al hacer clic en "Aceptar", aceptas las Condiciones del servicio.','To enable Apple Pay, domain association file must be hosted at %s.'=>'Para activar Apple Pay, el archivo de asociación de dominio debe alojarse en %s.','To enable JCB for your customers, you need to provide more information.'=>'Para habilitar JCB para tus clientes, necesitas proporcionar más información.','To enable Link by Stripe, you must first disable WooPay.'=>'Para activar Link, de Stripe, debes desactivar primero WooPay.','To enable WooPay, you must first disable Link by Stripe.'=>'Para activar WooPay, debes desactivar primero Link, de Stripe.','To ensure a smooth payments process, please make sure to confirm your bank details by <strong>%s</strong> or before you reach <strong>$5,000</strong> in sales.'=>'Para garantizar un proceso de pago sin complicaciones, confirma tus datos bancarios mediante <strong>%s</strong> o antes de alcanzar los <strong>5.000 $</strong> en ventas.','To ensure safe and secure transactions, a WordPress.com account is required before you can verify your business details.'=>'Para garantizar transacciones seguras y protegidas, necesitas una cuenta de WordPress.com; solo así podremos verificar los detalles de tu negocio.','To ensure safe and secure transactions, a WordPress.com account is required.'=>'Para garantizar transacciones seguras y protegidas, necesitas una cuenta de WordPress.com.','To enter your own exchange rates or update the formatting rules for each currency, visit the Multi-Currency settings.'=>'Para introducir tus propios tipos de cambio o modificar las normas de formato para cada moneda, ve a la configuración de la multidivisa.','To preview the express checkout buttons, activate at least one express checkout.'=>'Para obtener una vista previa de los botones para los pagos exprés, activa al menos una opción de pago exprés.','To preview the express checkout buttons, ensure your store uses HTTPS on a publicly available domain, and you\'re viewing this page in a Safari or Chrome browser. Your device must be configured to use Apple Pay or Google Pay.'=>'Para acceder a la vista previa de los botones de pago exprés, asegúrate de que tu tienda utiliza HTTPS en un dominio disponible públicamente y de que estás viendo esta página en un navegador Safari o Chrome. Tu dispositivo debe estar configurado para usar Apple Pay o Google Pay.','To submit evidence, provide documentation that supports your case. Keep in mind that submitting evidence doesn\'t ensure a favorable outcome. If the cardholder agrees to withdraw the inquiry, you\'ll still need to officially submit your evidence to prevent bank escalation. <learnMoreLink>Learn more</learnMoreLink>'=>'Para presentar pruebas, aporta documentación que apoye tu caso. Ten en cuenta que presentar pruebas no garantiza un resultado favorable. Si el titular de la tarjeta acepta retirar la consulta, aún tendrás que presentar oficialmente tus pruebas para evitar la escalada del banco. <learnMoreLink>Más información</learnMoreLink>','To use %s, you will need to verify your business details.'=>'Para utilizar %s, tienes que verificar los detalles de tu empresa.','ToS accept parameter is missing'=>'Falta el parámetro ToS accept','Today'=>'Hoy','Total balance'=>'Saldo total','Total balance = Available funds + Pending funds'=>'Saldo total = Fondos disponibles + Fondos pendientes','Total fees'=>'Total de las tarifas','Total payment volume'=>'Volumen total de pagos','Total payment volume = Charges - Refunds - Disputes'=>'Volumen total de pagos = Cargos - Reembolsos - Disputas','Total payment volume tooltip'=>'Información sobre el volumen total de pagos','Total per transaction'=>'Importe total por transacción','Total repaid'=>'Total amortizado','Total repaid placeholder'=>'Marcador de posición de Total amortizado','Track recurring revenue and manage active subscriptions directly from your store’s dashboard — powered by %s.'=>'Haz un seguimiento de los ingresos habituales y gestiona las suscripciones activas directamente en el escritorio de tu tienda con la tecnología de %s.','Tracking number'=>'Número de seguimiento','Transaction Fee:'=>'Cargo por transacción:','Transaction ID'=>'Nº de la transacción','Transaction actions'=>'Acciones de la transacción','Transaction fee'=>'Cargo por transacción','Transaction fees.'=>'Cargos por transacción.','Transaction link'=>'Enlace de transacción','Transaction preferences'=>'Preferencias de transacción','Transaction unauthorized'=>'Transacción autorizada','Transactions'=>'Transaciones','Transactions match <select /> filters'=>'Las transacciones coinciden con los filtros {{select /}}','Transactions match {{select /}} filters'=>'Las transacciones coinciden con los filtros {{select /}}','Transfer connection'=>'Transferir conexión','Transfer your %3$s connection from <hostname>%2$s</hostname> to this site <hostname>%1$s</hostname>. <hostname>%2$s</hostname> will be disconnected from %3$s.'=>'Transfiere tu conexión de %3$s de <hostname>%2$s</hostname> a este sitio <hostname>%1$s</hostname>. <hostname>%2$s</hostname> se desconectará de %3$s.','Transfer your connection'=>'Transferir tu conexión','Try to get in touch with your customer. Sometimes people forget about payments they make or don’t recognize the way they appear on their card statement. If this is the case, ask them to contact their card issuer and let them know they no longer dispute the transaction.'=>'Intenta ponerte en contacto con el cliente. A veces las personas se olvidan de los pagos que hacen o no los identifican en el extracto de la tarjeta. Si es el caso, dile que se ponga en contacto con el emisor de su tarjeta y que retire la disputa de la transacción.','Tuesday'=>'martes','Type'=>'Tipo','Type of business'=>'Tipo de empresa','Type of the payment method.'=>'Tipo de método de pago.','Typography'=>'Tipografía','UPE payment failed: %s'=>'Se ha producido un error en el pago UPE: %s','Unable to copy domain association file to domain root.'=>'No se puede copiar el archivo de asociación de dominio a la raíz del dominio.','Unable to create domain association folder to domain root.'=>'No se puede crear la carpeta de asociación de dominio a la raíz del dominio.','Unable to decode response from WooCommerce Payments API'=>'No se puede descodificar la respuesta de la API de WooCommerce Payments','Unable to determine payment success.'=>'No se ha podido determinar si se ha realizado el pago correctamente.','Unable to encode body for request to WooCommerce Payments API.'=>'No se puede codificar el cuerpo de la solicitud a la API de WooCommerce Payments.','Unable to find shipping method for address.'=>'No se puede encontrar el método de envío para la dirección.','Unable to generate renewal order for subscription on the "invoice.paid" event.'=>'No se puede generar la orden de renovación de la suscripción en el evento "invoice.paid".','Unable to generate renewal order for subscription to record the incoming "invoice.payment_failed" event.'=>'No se puede generar la orden de renovación de la suscripción para registrar el evento de entrada "invoice.payment_failed".','Unable to process the payment. Please try again later.'=>'No se puede procesar el pago. Inténtalo de nuevo más tarde.','Unable to update UPE appearance values at this time.'=>'No se pueden actualizar los valores de apariencia de UPE en este momento.','Unable to view order. Order not found.'=>'No se ha podido ver el pedido. Pedido no encontrado.','Unavailable'=>'No disponible','Uncaptured (%1$s)'=>'No capturadas (%1$s)','Uncaptured transactions'=>'Transacciones no capturadas','Under review'=>'En revisión','Underage. Age must be at least 18.'=>'Menor de edad. La edad mínima requerida es de 18 años.','Undo'=>'Deshacer','Unexpected server error'=>'Error inesperado del servidor','Unfortunately, your order has failed. Please <a href="%s">try checking out again</a>.'=>'Desafortunadamente, se ha producido un error con tu pedido. Por favor, <a href="%s">intenta efectuar el pago de nuevo</a>.','Union Pay'=>'Union Pay','UnionPay'=>'UnionPay','United Arab Emirates'=>'Emiratos Árabes Unidos','United Kingdom (UK)'=>'Reino Unido (UK)','United States (US)'=>'Estados Unidos (EEUU)','United States (US) dollar'=>'Dólar de los Estados Unidos (US)','Unknown'=>'Desconocido','Unknown document type'=>'Tipo de documento desconocido','Unknown error'=>'Error desconocido','Unknown transactions'=>'Transacciones desconocidas','Unrecognized'=>'No reconocido','Unsupported currency:'=>'Moneda no admitida:','Update'=>'Actualizar','Update %s business details'=>'Actualiza los detalles del negocio para %s','Update WordPress'=>'Actualizar WordPress','Update and retry payment'=>'Actualiza e intenta realizar el pago de nuevo','Update business details'=>'Actualizar detalles de la empresa','Update by %s to avoid a disruption in payouts.'=>'Actualiza mediante %s para evitar una interrupción en los pagos.','Update payment details'=>'Actualiza los datos de pago','Update payment method'=>'Actualizar el método de pago','Update selected'=>'Actualización elegida','Update your store\'s configuration to ensure smooth transactions.'=>'Actualiza la configuración de tu tienda para que las transacciones se realicen sin problemas.','Updates take a moment to appear. Please refresh the page in a minute.'=>'Los cambios tardan un poco en aparecer. Actualiza la página en un minuto.','Upload a custom logo. Upload a horizontal image with a white or transparent background for best results. Use a PNG or JPG image format. Recommended width: 512 pixels minimum.'=>'Sube un logotipo personalizado. Sube una imagen horizontal con un fondo blanco o transparente para obtener unos resultados óptimos. Utiliza un formato de imagen PNG o JPG. Anchura recomendada: 512 píxeles como mínimo.','Upload custom logo'=>'Cargar logotipo personalizado','Upload documentation for the prior payment that can uniquely identify it, such as a separate receipt. This document should be paired with a similar document from the disputed payment that proves the two are separate. This should also include a separate shipping label or receipt for the other payment. If multiple products were shipped together, provide a packing list that shows each purchase.'=>'Carga la documentación del pago anterior que pueda identificarlo de manera única, como un recibo por separado. Este documento debe ir acompañado de un documento similar del pago objeto de disputa para demostrar que los dos pagos son independientes. También debe incluirse una etiqueta o un recibo de envío correspondiente al otro pago. Si se enviaron varios productos juntos, proporciona un alabarán en el que consten todas las compras.','Upload file'=>'Cargar archivo','Use only kana characters.'=>'Utiliza solo caracteres kana.','Use only kanji characters.'=>'Utiliza solo caracteres kanji.','Use only latin characters.'=>'Utiliza solo caracteres latinos.','Use test card <number>%s</number> or refer to our <a>testing guide</a>.'=>'Utiliza la tarjeta de prueba <number>%s</number> o consulta nuestra <a>guía de pruebas</a>.','Use the bundled version of WooCommerce Admin'=>'Usa la versión agrupada de WooCommerce Admin','Use {{testCardHelpLink}}test card numbers{{/testCardHelpLink}} to simulate various transactions. {{learnMoreLink}}Learn more{{/learnMoreLink}}'=>'Simula varias transacciones utilizando {{testCardHelpLink}}números de tarjeta de prueba{{/testCardHelpLink}}. {{learnMoreLink}}Obtén más información{{/learnMoreLink}}.','VAT Number'=>'Número de IVA','Variable fee: %s'=>'Cargo variable: %s','Verification failed for an unknown reason. Correct any errors and resubmit the required fields.'=>'Se ha producido un error desconocido en la verificación. Corrige los errores y vuelve a enviar los campos obligatorios.','Verified name'=>'Nombre verificado','Verify bank details'=>'Verificar datos bancarios','Verify business details'=>'Verificar datos del negocio','Verify your bank account to start receiving payouts'=>'Verifica tu cuenta bancaria para empezar a recibir pagos','Verify your bank details'=>'Verifica tus datos bancarios','Verify your bank details by <strong>%s</strong> or before reaching <strong>$5,000</strong> in sales to avoid a disruption in payments.'=>'Para evitar las interrupciones en los pagos, verifica tus datos bancarios mediante <strong>%s</strong> o antes de alcanzar los <strong>5.000 $</strong> en ventas.','Verify your business details with %s to accept recurring payments for this subscription product.'=>'Para aceptar pagos recurrentes por este producto de suscripción, verifica la información de tu negocio con %s.','Verifying your information with %s'=>'Se está verificando tu información con %s','Version'=>'Versión','View Multi-Currency settings'=>'Ver la configuración de la multidivisa','View details'=>'Ver detalles','View dispute details'=>'Ver detalles de la disputa','View full payout history'=>'Ver todo el historial de pagos','View loan details'=>'Ver detalles del préstamo','View more details'=>'Ver más detalles','View order to issue refund'=>'Ver la orden para emitir el reembolso','View our documentation'=>'Ver nuestra documentación','View report'=>'Ver informe','View submitted evidence'=>'Ver las pruebas enviadas','View transactions'=>'Ver las transacciones','Viewing test %1$s. To view live %1s, disable test mode in {{settingsLink}}%2s settings{{/settingsLink}}.'=>'Se están visualizando las pruebas %1$s. Para ver %1s reales, desactiva el modo de prueba en los {{settingsLink}}ajustes de %2s{{/settingsLink}}.','Visa'=>'Visa','WCPay woopay order status sync'=>'Sincronización del estado del pedido de WCPay woopay','WPCOM Blog ID'=>'ID del blog de WPCOM','We appreciate your feedback!'=>'Agradecemos tus comentarios.','We could not verify that the person resides at the provided address. The address must be a valid physical address where the individual resides and cannot be a P.O. Box.'=>'No hemos podido comprobar que esa persona resida en la dirección facilitada. La dirección debe ser una dirección física válida en la que resida la persona y no un apartado de correos.','We couldn’t verify the postal code in the billing address. If the issue persists, suggest the customer to reach out to the card issuing bank.'=>'No hemos podido verificar el código postal de la dirección de facturación. Si el problema persiste, sugiere al cliente que se ponga en contacto con el banco emisor de la tarjeta.','We couldn’t verify the postal code in your billing address. Make sure the information is current with your card issuing bank and try again.'=>'No hemos podido verificar el código postal de tu dirección de facturación. Asegúrate de que el banco emisor de tu tarjeta tenga la información más reciente y vuelve a intentarlo.','We detected and prevented an attempt to pay for a duplicate order. If this was a mistake and you wish to try again, please create a new order.'=>'Hemos detectado y evitado un intento de pago por duplicado de un pedido. Si ha sido un error y quieres volver a intentarlo, crea un pedido nuevo.','We have identified executives that haven’t been added on the account. Add any missing executives to the account.'=>'Hemos identificado directivos que no se han añadido a la cuenta. Añade los directivos que falten a la cuenta.','We have identified holding companies with significant percentage ownership. Upload a Memorandum of Association for each of the holding companies.'=>'Hemos identificado sociedades de cartera con porcentajes de participación significativos. Sube la escritura constitutiva de cada una de las sociedades de cartera.','We have identified owners that haven’t been added on the account. Add any missing owners to the account.'=>'Hemos identificado propietarios que no se han añadido a la cuenta. Añade los propietarios que falten a la cuenta.','We need more information from you to enable this method. {{learnMoreLink}}Learn more.{{/learnMoreLink}}'=>'Necesitamos más información sobre ti para poder activar este método. {{learnMoreLink}}Más información.{{/learnMoreLink}}','We noticed you\'re visiting from %1$s. We\'ve updated our prices to %2$s for your shopping convenience. <a href="%4$s">Use %3$s instead.</a>'=>'Hemos visto que nos visitas desde %1$s. Hemos actualizado nuestros precios en %2$s para que comprar resulte más sencillo. <a href="%4$s">Utiliza %3$s en su lugar.</a>','We prevented multiple payments for the same order. If this was a mistake and you wish to try again, please create a new order.'=>'Hemos impedido varios pagos del mismo pedido. Si ha sido un error y quieres volver a intentarlo, crea un pedido nuevo.','We take every step required to safeguard your personal data. %s is built in partnership with Stripe to store your data in a safe and secure manner.'=>'Tomamos todas las medidas necesarias para proteger tus datos personales. %s se ha creado en colaboración con Stripe para almacenar tus datos de forma segura.','We will automatically submit any saved evidence at the due date.'=>'Enviaremos automáticamente las pruebas guardadas en la fecha límite.','We\'ll do our best to work with Stripe to confirm your identity as quickly as we can. Typically, we\'ll confirm your application within a couple of days.'=>'Haremos todo lo posible por trabajar con Stripe y confirmar tu identidad tan rápido como podamos. Por lo general, confirmamos las aplicaciones en el plazo de un par de días.','We\'re not able to add this payment method. Please refresh the page and try again.'=>'No podemos añadir este método de pago. Actualiza la página e inténtalo de nuevo.','We\'re not able to add this payment method. Please try again later'=>'No podemos añadir este método de pago. Por favor, inténtalo de nuevo más tarde','We\'re not able to process this payment due to the order ID mismatch. Please try again later.'=>'No hemos podido procesar este pago debido a un error de coincidencia en el ID del pedido. Inténtalo de nuevo más tarde.','We\'re not able to process this payment. Please refresh the page and try again.'=>'No podemos procesar este pago. Actualiza la página e inténtalo de nuevo.','We\'re not able to process this payment. Please try again later.'=>'No podemos procesar este pago. Por favor, inténtalo de nuevo más tarde.','We\'re not able to process this payment. Please try again later. WooPayMeta: intent_meta_order_id: %1$s, order_id: %2$s'=>'No podemos procesar este pago. Inténtalo de nuevo más tarde. WooPayMeta: intent_meta_order_id: %1$s, order_id: %2$s','We\'re not able to process this request. Please refresh the page and try again.'=>'No podemos procesar esta solicitud. Actualiza la página e inténtalo de nuevo.','We\'ve successfully collected payment for your subscription using your new payment method.'=>'Hemos recibido correctamente el pago de la suscripción a través del nuevo método de pago.','We\'ve temporarily paused new account creation. We\'ll notify you when we resume!'=>'Hemos pausado temporalmente la creación de nuevas cuentas. Te avisaremos al reanudar la operación.','WeChat Pay'=>'WeChat Pay','Wednesday'=>'miércoles','Weekly'=>'Semanalmente','Weekly anchor for deposit scheduling when interval is set to weekly'=>'Fecha del plazo semanal del calendario de depósitos cuando el intervalo se haya establecido en formato semanal.','We’ll use these details to enable payments for your store. This information can’t be changed after your account is created.'=>'Utilizaremos estos datos para activar los pagos en tu tienda. Esta información no se puede cambiar una vez creada tu cuenta.','We’re processing your export. 🎉 The file will download automatically and be emailed to %s.'=>'Estamos procesando la exportación. 🎉 El archivo se descargará automáticamente y se enviará por correo electrónico a %s.','We’ve detected that you have duplicate sites connected to %s. When Safe Mode is active, payments will not be interrupted. However, some features may not be available until you’ve resolved this issue below. Safe Mode is most frequently activated when you’re transferring your site from one domain to another, or creating a staging site for testing. <safeModeLink>Learn more</safeModeLink>'=>'Hemos detectado que tienes sitios duplicados conectados a %s. Si el modo seguro está activo, los pagos no se interrumpirán. Sin embargo, es posible que algunas funciones no estén disponibles hasta que hayas resuelto este problema que te mostramos a continuación. Con frecuencia, el modo seguro se activa cuando se transfiere el sitio de un dominio a otro o se crea un sitio de prueba. <safeModeLink>Obtén más información</safeModeLink>','We’ve detected that you have duplicate sites connected to %s. When Safe Mode is active, payments will not be interrupted. However, some features may not be available until you’ve resolved this issue below. Safe Mode is most frequently activated when you’re transferring your site from one domain to another, or creating a staging site for testing. A site administrator can resolve this issue. <safeModeLink>Learn more</safeModeLink>'=>'Hemos detectado que tienes sitios duplicados conectados a %s. Si el modo seguro está activo, los pagos no se interrumpirán. Sin embargo, es posible que algunas funciones no estén disponibles hasta que hayas resuelto este problema que te mostramos a continuación. Con mayor frecuencia, el modo seguro se activa cuando se transfiere el sitio de un dominio a otro o bien se crea un sitio de pruebas. Un administrador del sitio puede resolver este problema. <safeModeLink>Más información</safeModeLink>','We’ve saved your product as a draft.'=>'Hemos guardado tu producto como borrador.','What category of legal entity identify your business?'=>'¿Qué categoría de entidad jurídica identifica a tu empresa?','What else should I keep in mind while completing this process?'=>'¿Qué más debería tener en cuenta al completar este proceso?','What information should I have at hand before I start the “Know Your Customer” process?'=>'¿Qué información debo tener a mano antes de empezar el proceso "Conoce a tu cliente?','What is the estimated timeline for taking your store live?'=>'¿Cuál es el periodo de tiempo previsto para poner en marcha tu tienda?','What is your estimated annual Ecommerce revenue (USD)?'=>'¿Cuáles son tus ingresos anuales estimados para eCommerce (en USD)?','What is “Know Your Customer”?'=>'¿Qué es "Conoce a tu cliente"?','What payment methods are enabled for the store.'=>'Qué métodos de pago están activados en la tienda.','What type of goods or services does your business sell? '=>'¿Qué tipo de productos o servicios vende tu empresa? ','What type of legal entity is your business?'=>'¿Qué tipo de entidad jurídica es tu empresa?','When enabled debug notes will be added to the log.'=>'Si la opción está activada, se añadirán notas de depuración al registro.','When enabled, WooPay checkout will be themed with your store’s brand colors and fonts. {{docs}}Learn more {{/docs}}'=>'Cuando se habilita, el pago mediante WooPay se adapta a los colores y fuentes de la tienda de tu marca. {{docs}}Más información {{/docs}}','When enabled, customers who have configured Apple Pay or Google Pay enabled devices will be able to pay with their respective choice of Wallet.'=>'Si esta opción está habilitada, los clientes que hayan configurado dispositivos habilitados para Apple Pay o Google Pay podrán hacer el pago con la cartera que hayan elegido.','When enabled, customers will be able to checkout using WooPay.'=>'Si esta opción está habilitada, los clientes podrán realizar el pago a través de WooPay','When enabled, customers will be able to checkout using WooPay. In order to use {{wooPayLink}}WooPay{{/wooPayLink}}, you must agree to our {{tosLink}}WooCommerce Terms of Service{{/tosLink}} and {{privacyLink}}Privacy Policy{{/privacyLink}}. {{trackingLink}}Click here{{/trackingLink}} to learn more about the data you will be sharing and opt-out options.'=>'Si esta opción está habilitada, los clientes podrán realizar el pago a través de WooPay. Para usar {{wooPayLink}}WooPay{{/wooPayLink}}, debes aceptar las {{tosLink}}condiciones del servicio de WooCommerce{{/tosLink}} y la {{privacyLink}}Política de privacidad{{/privacyLink}}. {{trackingLink}}Haz clic aquí{{/trackingLink}} para obtener más información sobre los datos que se van a compartir y las opciones para darse de baja.','When enabled, payment error logs will be saved to WooCommerce > Status > Logs.'=>'Al activarse, los registros de errores de pago se guardarán en WooCommerce > Estado > Registros.','When enabled, payment methods powered by %s will appear on checkout.'=>'Al activarse, los métodos de pago facilitados por %s aparecerán en la página de pago.','When enabled, the payment will be blocked.'=>'Cuando esté activada esta opción, se bloqueará el pago.','When enabled, users will be able to pay with a saved card during checkout. Card details are stored in our platform, not on your store.'=>'Cuando se activa esta opción, permite a los usuarios pagar con una tarjeta guardada durante el proceso de pago. Los datos de la tarjeta se almacenan en nuestra plataforma, no en tu tienda.','When you reset your account, all payment data — including your %1$s account details, test transactions, and payouts history — will be lost. Your order history will remain. This action cannot be undone, but you can create a new test account at any time.'=>'Si restableces tu cuenta, se perderán todos los datos, incluidos los detalles de tu cuenta de %1$s, las transacciones de prueba y el historial de pagos. Se conservará tu historial de pagos. Esta acción no se puede deshacer, pero puedes volver a crear una cuenta de prueba en cualquier momento.','When you reset your test account, all payment data — including your %1$s account details, test transactions, and payouts history — will be lost. Your order history will remain. This action cannot be undone, but you can create a new test account at any time.'=>'Si restableces tu cuenta de prueba, se perderán todos los datos de pago, incluidos los detalles de tu cuenta de %1$s, las transacciones de prueba y el historial de pagos. Se conservará tu historial de pedidos. Esta acción no se puede deshacer, pero puedes volver a crear una cuenta de prueba en cualquier momento.','When you submit your evidence, we\'ll format it and send it to the cardholder\'s bank, then email you once the dispute has been decided.'=>'Cuando envíes las pruebas, les aplicaremos formato y las remitiremos al banco del titular de la tarjeta. A continuación, te enviaremos un correo electrónico cuando se haya resuelto la disputa.','Where is your business located?'=>'¿Dónde está ubicado tu negocio?','Whether debug logging is enabled and working or not.'=>'Si el registro de depuración está activado y funcionando o no.','Whether the new WooPay Express Checkout is enabled or not.'=>'Si el nuevo pago rápido de WooPay está activado o no.','Whether the payment gateway has test payments enabled or not.'=>'Si la pasarela de pago tiene activados o no los pagos de prueba.','Whether the store has Payment Request enabled or not.'=>'Si la tienda tiene activada la solicitud de pago o no.','Whether the store has the Auth & Capture feature enabled or not.'=>'Si la tienda tiene activada o no la función de autenticar y capturar.','Whether the store has the Multi-currency feature enabled or not.'=>'Si la tienda tiene activada o no la función de multidivisa.','Whether the tax documents section is enabled or not.'=>'Si la sección de documentos fiscales está activada o no.','Whether there are extensions active that are have known incompatibilities with the functioning of the new WooPay Express Checkout.'=>'Si hay extensiones activas que tengan incompatibilidades conocidas con el funcionamiento del nuevo pago rápido de WooPay.','Whether there is a Stripe Billing off-site to on-site billing migration in progress.'=>'Si hay una migración externa de Stripe Billing a la facturación interna en progreso o no.','Why do I have to share this information?'=>'¿Por qué tengo que compartir esta información?','Why do you feel that way? (optional)'=>'¿Por qué piensas así? (opcional)','Why we ask for personal financial information'=>'Por qué pedimos información financiera personal','With the following message: <code>%s</code>'=>'Con el siguiente mensaje: <code>%s</code>','With {{strong}}instant payout{{/strong}} you can receive requested funds in your bank account within 30 mins for a %s%% fee. {{learnMoreLink}}Learn more{{/learnMoreLink}}'=>'Con el {{strong}}pago instantáneo{{/strong}} puedes recibir los fondos solicitados en tu cuenta bancaria en 30 minutos a cambio de una comisión de %s%%. {{learnMoreLink}}Más información{{/learnMoreLink}}','Withdrawal'=>'Retirada','Withdrawal amount'=>'Importe de la retirada','Withdrawal date'=>'Fecha de la retirada','Withdrawal details'=>'Detalles de la retirada','Withdrawal overview'=>'Resumen de retiradas','Withhold rate'=>'Tasa de retención','Within 1 month'=>'Menos de 1 mes','Won'=>'Ganada','WooCommerce'=>'WooCommerce','WooCommerce In-Person Payments'=>'Pagos en persona de WooCommerce','WooCommerce Payments: detected and deleted order ID %d, which has duplicate cart content with this order.'=>'WooCommerce Payments: se ha detectado y eliminado el pedido con ID %d, que está duplicado en el carro de compra.','WooPay'=>'WooPay','WooPay Connect Direct Checkout'=>'Pagos directos y conexión con WooPay','WooPay Disable Feedback'=>'Desactivar comentarios de WooPay','WooPay Express Checkout'=>'Pago rápido de WooPay','WooPay Incompatible Extensions'=>'Extensiones de WooPay incompatibles','WooPay Logo'=>'Logotipo de WooPay','WooPay SMS code verification'=>'Verificación del código por SMS de WooPay','WooPay blog_token is currently misconfigured.'=>'El blog_token de WooPay está mal configurado.','WooPay button'=>'Botón de WooPay','WooPay button locations'=>'Ubicaciones del botón de WooPay','WooPay cannot be enabled at checkout. Click to expand.'=>'WooPay no puede activarse durante el proceso de compra. Haz clic para ampliar.','WooPay is not available, as a %s feature, or the store is not yet eligible.'=>'WooPay no está disponible, como una función %s, o la tienda aún no es elegible.','WooPay is unavailable at this time. Please complete your checkout below. Sorry for the inconvenience.'=>'WooPay no está disponible en este momento. Completa tu compra a continuación. Lamentamos las molestias.','WooPay is unavailable at this time. Sorry for the inconvenience.'=>'WooPay no está disponible en este momento. Lamentamos las molestias.','WooPay request is not signed correctly.'=>'La solicitud de WooPay no está firmada correctamente.','WooPayments'=>'WooPayments','WooPayments Disable Survey'=>'Desactivar encuesta de WooPayments','WooPayments Logo'=>'Logotipo de WooPayments','WooPayments is not used during checkout.'=>'WooPayments no se utiliza durante el pago.','WooPayments was in test mode when this order was placed. {{learnMoreLink/}}'=>'WooPayments estaba en modo de prueba cuando se realizó este pedido. {{learnMoreLink/}}','Would you mind sharing more about why you chose that option?'=>'¿Te importaría compartir más información sobre por qué has elegido esa opción?','Year to date'=>'Año hasta la fecha','Yes'=>'Si','Yes, continue'=>'Sí, continuar','Yes, deactivate %s'=>'Sí, desactivar %s','Yes, reset account'=>'Sí, restablecer cuenta','You are about to export %d deposits. If you\'d like to reduce the size of your export, you can use one or more filters. Would you like to continue?'=>'Vas a exportar %d depósitos. Para reducir el tamaño de la exportación, puedes utilizar uno o varios filtros. ¿Quieres continuar?','You are about to export %d disputes. If you\'d like to reduce the size of your export, you can use one or more filters. Would you like to continue?'=>'Vas a exportar %d disputas. Para reducir el tamaño de la exportación, puedes utilizar uno o varios filtros. ¿Quieres continuar?','You are about to export %d transactions. If you\'d like to reduce the size of your export, you can use one or more filters. Would you like to continue?'=>'Estás a punto de exportar %d transacciones. Para reducir el tamaño de la exportación, puedes utilizar uno o varios filtros. ¿Quieres continuar?','You are using a test account. If you are experiencing problems completing account setup, or wish to test with a different email/country associated with your account, you can reset your account and start from the beginning.'=>'Estás usando una cuenta de prueba. Si tienes problemas para completar la configuración de la cuenta o quieres probar a asociar otro país/correo electrónico a tu cuenta, puedes restablecer la cuenta y empezar desde el principio.','You aren’t authorized to do that.'=>'No dispones de la autorización para realizar eso.','You can add %s (%s) again at any time in Multi-Currency settings.'=>'Puedes volver a añadir %s (%s) en cualquier momento en la configuración de la multidivisa.','You can add it again at any time in {{wooCommercePaymentsLink /}}.'=>'Puedes añadirlo de nuevo en cualquier momento en {{wooCommercePaymentsLink /}}','You can also save this evidence for later instead of submitting it immediately.'=>'También puedes guardar las pruebas para más adelante, en lugar de enviarlas inmediatamente.','You can choose a level of protection for screening incoming transactions. Screened transactions will be automatically blocked by your customized fraud filters.'=>'Puedes elegir un nivel de protección para evaluar las transacciones entrantes. Tus filtros personalizados contra el fraude bloquearán automáticamente las transacciones detectadas.','You cannot add that amount of "%1$s"; to the cart because there is not enough stock (%2$s remaining).'=>'No puedes añadir esa cantidad de %1$s"; al carrito porque no hay suficientes existencias (restantes: %2$s).','You have 30 days from your first transaction or until you reach $5,000 in sales to verify your information and set up payouts.'=>'Tienes 30 días desde tu primera transacción o hasta que alcances 5000 $ en ventas para verificar tu información y configurar los pagos.','You have accepted the dispute for order #%s.'=>'Has aceptado la disputa del núm. de pedido %s.','You have accepted the dispute.'=>'Has aceptado al disputa.','You have exceeded the number of allowed verification attempts.'=>'Has superado el número de intentos de verificación permitidos.','You have installed a development version of %s which requires files to be built. From the plugin directory, run <code>npm run build:client</code> to build and minify assets. Alternatively, you can download a pre-built version of the plugin from the <a1>WordPress.org repository</a1> or by visiting the <a2>releases page in the GitHub repository</a2>.'=>'Has instalado una versión de desarrollo de %s que requiere la compilación de archivos. En el directorio del plugins, ejecuta <code>npm run build:client</code> para compilar y minificar los activos. También puedes descargar una versión preconstruida del plugin desde el <a1>repositorio de WordPress.org</a1> o visitando la <a2>página de versiones en el repositorio de GitHub</a2>.','You have no funds available. {{whyLink}}Why?{{/whyLink}}'=>'No dispones de fondos. {{whyLink}}¿Por qué?{{/whyLink}}','You have reached the <strong>30-day limit</strong> for early selling access. In order to reactivate payments, please verify your bank details.'=>'Has alcanzado el <strong>límite de 30 días</strong> para acceder a la venta anticipada. Para reactivar los pagos, verifica tus datos bancarios.','You have time until <strong>%s</strong> to make your first sale without undergoing full business verification. Take advantage of this time window and start selling now.'=>'Tienes hasta el <strong>%s</strong> para hacer tu primera venta sin que tengas que pasar por el proceso de verificación completa de la empresa. Aprovecha este plazo de tiempo y empieza a vender ahora mismo.','You must <a>capture</a> this charge within the next'=>'Debes <a>capturar</a> este cargo en los próximos ','You must accept our %1$s and %2$s to continue with your purchase.'=>'Debes aceptar nuestros %1$s y nuestra %2$s para continuar con tu compra.','You need to provide more information to enable %s on your checkout.'=>'Debes facilitar más información para activar %s en el pago.','You need to provide more information to enable %s on your checkout:'=>'Debes facilitar más información para activar %s en el pago:','You shall refund this payment in the same application where the payment was made.'=>'Debes reembolsar este pago en la misma aplicación en la que se realizó.','You should be especially wary when a customer has an international IP address but uses domestic billing and shipping information. Fraudsters often pretend to live in one location, but live and shop from another.'=>'Deberías tener especial cuidado si un cliente tiene una dirección IP internacional, pero introduce información de facturación y envío nacional. Los estafadores a menudo fingen que residen en una ubicación, pero en realidad viven y hacen las compras desde otra diferente.','You should first get in touch with your customer. If you understand what their complaint is, there is a chance for you to explain the misunderstanding or to make it right. If you’re able to resolve the issue with your customer, you can ask that they withdraw the dispute.'=>'Primero debes ponerte en contacto con el cliente. Si entiendes su queja, tienes la oportunidad de explicarle el malentendido o arreglarlo. Si consigues resolver el problema con el cliente, puedes pedirle que retire la disputa.','You submitted evidence for this dispute on %s. The cardholder’s bank is reviewing the case, which can take 60 days or more. You will be alerted when they make their final decision. <a>Learn more about the dispute process</a>.'=>'Presentaste pruebas para esta disputa el %s. El banco del titular de la tarjeta está revisando el caso, lo que puede demorarse 60 días o más. Te avisarán cuando tomen la decisión final. <a>Más información sobre el proceso de la disputa</a>.','You submitted evidence for this inquiry on %s. The cardholder’s bank is reviewing the case, which can take 120 days or more. You will be alerted when they make their final decision. <a>Learn more</a>.'=>'Presentaste pruebas para esta consulta el %s. El banco del titular de la tarjeta está revisando el caso, lo que puede demorarse 120 días o más. Te avisarán cuando tomen la decisión final. <a>Más información</a>.','You will be taken to the order, where you must complete the refund process manually.'=>'Accederás al pedido, donde deberás completar el proceso de reembolso manualmente.','You will have to re-confirm your business and banking details.'=>'Tendrás que volver a confirmar la información de tu negocio y los detalles bancarios.','You\'ll need to verify your business and payment details to '=>'Tendrás que verificar los datos de pago y de tu negocio para ','You\'re ready to accept payments!'=>'¡Ya puedes aceptar pagos!','You\'re ready to begin accepting payments using foreign currencies!'=>'Ya tienes todo listo para empezar a aceptar pagos con monedas extranjeras.','You\'ve already added {{enabledCurrenciesText /}} to your store.'=>'Ya has añadido {{enabledCurrenciesText /}} a tu tienda.','Your %s account will be reset, and all data will be lost.'=>'Tu cuenta de %s se restablecerá y se perderán todos los datos.','Your JCB account was rejected based on the information provided.'=>'Tu cuenta de JCB se ha rechazado en base a la información facilitada.','Your account has insufficient funds to cover your negative balance.'=>'Tu cuenta no tiene fondos suficientes para hacer la transferencia.','Your bank notified us that the bank account holder address on file is incorrect.'=>'Tu banco nos ha informado de que la dirección del titular de la cuenta bancaria registrada es incorrecta.','Your bank notified us that the bank account holder tax ID on file is incorrect.'=>'Tu banco nos ha informado de que el número de identificación fiscal del titular de la cuenta bancaria registrado es incorrecto.','Your bank notified us that the bank account number is too long.'=>'Tu banco nos ha informado de que el número de cuenta bancaria es demasiado largo.','Your capital loan has been approved!'=>'Tu préstamo de capital se ha aprobado.','Your domain has been verified with Apple Pay!'=>'Se ha verificado tu dominio con Apple Pay.','Your explanation for why the customer is not entitled to a refund.'=>'Tu explicación de por qué el cliente no tiene derecho a reembolso.','Your feedback inspires us to create new features and refine existing ones to better serve you.'=>'Tus comentarios nos inspiran a crear nuevas funciones y perfeccionar las que ya tenemos para ofrecerte un mejor servicio.','Your feedback will be only be shared with WooCommerce and treated pursuant to our <a>privacy policy</a>.'=>'Tus comentarios solo se compartirán con WooCommerce y se tratarán de conformidad con nuestra <a>política de privacidad</a>.','Your feedback will be sent to the WooCommerce team. Your personal information is secure and will not be shared with third parties. For more details, please see our '=>'Tus comentarios se enviarán al equipo de WooCommerce. Tu información personal es segura y no se compartirá con terceros. Para obtener más información, consulta nuestra ','Your first payout is held for 7-14 days. {{whyLink}}Why?{{/whyLink}}'=>'Tu primer pago se retiene entre 7 y 14 días. {{whyLink}}¿Por qué?{{/whyLink}}','Your first payout will be held for 7-14 days. Payout scheduling will be available after this period. {{learnMoreLink}}Learn more{{/learnMoreLink}}'=>'Tu primer pago se retendrá entre 7 y 14 días. El programa de pagos estará disponible después de este período. {{learnMoreLink}}Más información{{/learnMoreLink}}','Your information has been submitted and your JCB account is pending approval.'=>'Tu información se ha enviado y tu cuenta de JCB está pendiente de aprobación.','Your insights guide others in choosing the right payment solution.'=>'Tus conocimientos ayudan a los demás a elegir la solución de pago adecuada.','Your order is on hold until payment is received. Please follow the payment instructions by the expiry date.'=>'Tu pedido está en espera hasta que se reciba el pago. Sigue las instrucciones de pago antes de la fecha de caducidad.','Your payment activity'=>'Tu actividad de pago','Your payment was not processed.'=>'Tu pago no ha sido procesado.','Your payouts are {{strong}}temporarily suspended{{/strong}}. {{suspendLink}}Learn more{{/suspendLink}}'=>'Tus pagos están {{strong}}suspendidos temporalmente{{/strong}}. {{suspendLink}}Más información{{/suspendLink}}','Your product prices are automatically converted from your default currency (%s) based on the currency exchange rate and formatting rules for each currency.'=>'Los precios de tus productos se convertirán automáticamente a partir de la moneda que hayas establecido por defecto (%s) basándose en el tipo de cambio y las normas de formato de cada moneda.','Your receipt for order: #{order_number}'=>'El recibo de tu pedido: n.º {order_number}','Your refund policy, as shown or provided to the customer.'=>'Tu política de reembolso, tal como se le muestra o proporciona al cliente.','Your site is currently in Safe Mode.'=>'En este momento, tu sitio está en modo a prueba de fallos.','Your store has active subscriptions using the built-in %6$s functionality. Due to the %1$soff-site billing engine%3$s these subscriptions use, %4$sthey will continue to renew even after you deactivate %6$s%5$s. %2$sLearn more%3$s.'=>'Tu tienda tiene suscripciones activas que utilizan la funcionalidad integrada de %6$s. Debido al %1$smotor de facturación externo%3$s que utilizan estas suscripciones, %4$sse seguirán renovando incluso después de que hayas desactivado %6$s%5$s. %2$sMás información%3$s.','Your store has subscriptions using %5$s Stripe Billing functionality for payment processing. Due to the %1$soff-site billing engine%2$s these subscriptions use,%3$s they will continue to renew even after you deactivate %6$s%4$s.'=>'Tu tienda tiene suscripciones que usan la funcionalidad %5$s Stripe Billing para el procesamiento de pagos. Debido al %1$smotor de facturación externo%2$s que utilizan estas suscripciones,%3$s se seguirán renovando incluso después de que hayas desactivado %6$s%4$s.','Your store has subscriptions using %6$s Stripe Billing functionality for payment processing. Due to the %1$soff-site billing engine%3$s these subscriptions use,%4$s they will continue to renew even after you deactivate %6$s%5$s.'=>'Tu tienda tiene suscripciones que usan la funcionalidad %6$s Stripe Billing para el procesamiento de pagos. Debido al %1$smotor de facturación externo%3$s que utilizan estas suscripciones,%4$s se seguirán renovando incluso después de que hayas desactivado %6$s%5$s.','Your subscription cancellation policy, as shown to the customer.'=>'Tu política de cancelación de la suscripción, tal como se le muestra al cliente.','Your subscription\'s last renewal failed payment. Please update your payment details so we can reattempt payment.'=>'Se ha producido un error en el pago de la última renovación de tu suscripción. Para que podamos reintentar el pago, debes actualizar los datos de pago.','Your test account will be deactivated, but your transactions can be found in your order history.'=>'Tu cuenta de prueba se desactivará, pero puedes encontrar tus transacciones en el historial de pedidos.','Your {site_title} Receipt'=>'Tu recibo {site_title}','You’re now eligible to receive Instant Payouts with %s'=>'Ya puedes optar a recibir Pagos instantáneos con %s','You’re only steps away from getting paid'=>'Solo unos pasos más y podrás aceptar pagos','You’re ready to start using the features and benefits of %s.'=>'Todo listo para empezar a utilizar las funciones y las ventajas de %s.','[{site_title}] Automatic payment failed for {order_number}. Customer asked to authenticate payment and will be notified again {retry_time}'=>'[{site_title}] Automatic payment failed for {order_number}. Customer asked to authenticate payment and will be notified again {retry_time}','a day'=>'un día','a minute'=>'un minuto','a second'=>'un segundo','address placeholder'=>'marcador de posición de dirección','an email notificationEnable/disable'=>'Activar/Desactivar','an hour'=>'una hora','and'=>'y','any'=>'ninguna','authorization(s)'=>'autorizaciones','authorized but payment has not been captured'=>'autorizado pero el pago no se ha obtenido','bank code placeholder'=>'marcador de posición de código del banco','bank name placeholder'=>'marcador de posición de nombre del banco','bic placeholder'=>'marcador de posición bic','blocked'=>'bloqueado','cancel the payment'=>'cancelar el pago','cancelled'=>'cancelado','capture the payment'=>'obtener el pago','card type placeholder'=>'marcador de posición de tipo de tarjeta','completed'=>'completado','country placeholder'=>'marcador de posición de país','created'=>'creado','credit'=>'crédito','custom addon price in order (%1$s)'=>' (%1$s)','customer_name placeholder'=>'marcador de posición customer_name','date placeholder'=>'marcador de posición de fecha','debit'=>'débito','dispute'=>'disputa' . "\0" . 'disputas','document'=>'documento' . "\0" . 'documentos','eight'=>'ocho','email placeholder'=>'marcador de posición del correo electrónico','enable payouts.'=>'activar los pagos.','failed'=>'Fallidas','fees'=>'cuotas','fingerprint placeholder'=>'marcador de posición d