ong}}%1$s está en modo de entorno de pruebas.{{/strong}} Tienes que configurar una cuenta de %1$s activa para poder aceptar transacciones reales.','{{strong}}%1$s is in test mode.{{/strong}} All transactions will be simulated. {{learnMoreLink}}Learn more{{/learnMoreLink}}'=>'{{strong}}%1$s está en modo de prueba.{{/strong}} Todas las transacciones serán simuladas. {{learnMoreLink}}Más información{{/learnMoreLink}}','{{strong}}Disputes{{/strong}} includes the amount of any disputed charges. Dispute fees are included in the Fees section. {{learnMoreLink}}Learn more{{/learnMoreLink}}.'=>'{{strong}}Disputas{{/strong}} incluye el importe de cualquier cargo objeto de disputa. Las tasas de disputa se incluyen en la sección Tasas. {{learnMoreLink}}Más información{{/learnMoreLink}}.','{{strong}}Fees{{/strong}} includes all types of fees charged by WooPayments. {{learnMoreLink}}Learn more{{/learnMoreLink}}.'=>'{{strong}}Tasas{{/strong}} incluye todos los tipos de tasas cobradas por WooPayments. {{learnMoreLink}}Más información{{/learnMoreLink}}.','{{strong}}Need help?{{/strong}} Learn more about {{wooCommercePaymentsLink}}%s{{/wooCommercePaymentsLink}} or {{contactSupportLink}}contact WooCommerce Support{{/contactSupportLink}}.'=>'{{strong}}¿Necesitas ayuda?{{/strong}} Obtén más información sobre {{wooCommercePaymentsLink}}%s{{/wooCommercePaymentsLink}} o {{contactSupportLink}}ponte en contacto con el soporte de WooCommerce{{/contactSupportLink}}.','{{strong}}No payments…yet!{{/strong}}'=>'{{strong}}Sin pagos... ¡Por ahora!{{/strong}}','{{strong}}Total payment volume{{/strong}} is the sum of all transactions in a given time period, minus refunds and disputes.'=>'El {{strong}}volumen total de pagos{{/strong}} es la suma de todas las transacciones en un periodo de tiempo determinado, menos las devoluciones y las disputas.','{{title}}Customer Currency{{/title}} {{rule /}} {{filter /}}'=>'{{title}}Moneda del cliente{{/title}} {{rule /}} {{filter /}}','{{title}}Customer country{{/title}} {{rule /}} {{filter /}}'=>'{{title}}País del cliente{{/title}} {{rule /}} {{filter /}}','{{title}}Customer currency{{/title}} {{rule /}} {{filter /}}'=>'{{title}}Moneda del cliente{{/title}} {{rule /}} {{filter /}}','{{title}}Date{{/title}} {{rule /}} {{filter /}}'=>'{{title}}Fecha{{/title}} {{rule /}} {{filter /}}','{{title}}Device type{{/title}} {{rule /}} {{filter /}}'=>'{{title}}Tipo de dispositivo{{/title}} {{rule /}} {{filter /}}','{{title}}Loan{{/title}} {{rule /}} {{filter /}}'=>'{{title}}Préstamo{{/title}} {{rule /}} {{filter /}}','{{title}}Risk Level{{/title}} {{rule /}} {{filter /}}'=>'{{title}}Nivel de riesgo{{/title}} {{rule /}} {{filter /}}','{{title}}Sales channel{{/title}} {{rule /}} {{filter /}}'=>'{{title}}Canal de venta{{/title}} {{rule /}} {{filter /}}','{{title}}Status{{/title}} {{rule /}} {{filter /}}'=>'{{title}}Estatus{{/title}} {{rule /}} {{filter /}}','{{title}}Type{{/title}} {{rule /}} {{filter /}}'=>'{{title}}Tipo{{/title}} {{rule /}} {{filter /}}','{{wrapper}}Review store settings{{/wrapper}}'=>'{{wrapper}}Revisar la configuración de la tienda{{/wrapper}}','“Know Your Customer” standards are used by banks and other financial institutions to confirm that customers are who they say they are. By confirming their customers\' identities, banks and financial institutions can help keep transactions safe from fraud and other suspicious activities.'=>'Los estándares de "Conoce a tu cliente" los utilizan bancos y otras instituciones financieras para confirmar que los clientes son quienes afirman ser. Al confirmar las identidades de los clientes, los bancos e instituciones financieras pueden proteger las transacciones contra fraudes y otras actividades sospechosas.','• Customer name and email address linked to their customer profile'=>'• Nombre del cliente y dirección de correo electrónico enlazada a su perfil de cliente','• Customer\'s IP address and their device\'s geographical location at the time of purchase'=>'• Dirección IP del cliente y ubicación geográfica de su dispositivo en el momento de la compra','• Device ID and name of the device'=>'• ID y nombre del dispositivo','• Evidence that the customer logged into their account for your business before the transaction date'=>'• Pruebas de que el cliente inició sesión en tu negocio con su cuenta antes de la fecha de la transacción','• Evidence that the same device and card used in the disputed payment was used in a previous payment that was not disputed'=>'• Pruebas de que el mismo dispositivo y la misma tarjeta utilizados en el pago objeto de disputa se utilizaron en un pago anterior que no causó ningún conflicto','• Evidence that your website or app was accessed by the cardholder for purchase or services on or after the transaction date'=>'• Pruebas de que el titular de la tarjeta accedió a tu sitio web o aplicación para comprar un producto o servicio en la fecha de la transacción o después de esta','•••'=>'•••']];
